Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673845943124&amp;bpp=3&amp;bdt=1791&amp;idt=414&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;prev_fmts=300x250&amp;nras=1&amp;correlator=2510758362366&amp;frm=20&amp;pv=1&amp;ga_vid=1524087634.1673845882&amp;ga_sid=1673845943&amp;ga_hid=1076811745&amp;ga_fc=1&amp;ga_cid=339004216.1673845882&amp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=512&amp;ady=5325&amp;biw=1519&amp;bih=666&amp;scr_x=0&amp;scr_y=2715&amp;eid=44759875%2C44759926%2C44759842%2C44777876%2C44774606%2C44779793&amp;oid=2&amp;psts=ACgb8tuZ9wn6sz4r9zI_1dCLp7u880pV60BhzeqSc9zGgAtgP1SlYit4eA3cB99vJzAfdEY0cTt6a9aBNvlh9A%2CACgb8tvrvrLqcxOuX5JwpQfv7DKu03bdGcAqJW0ns3GyopqYVqDHIUfwKxROxhFWRanG_Az_2bgm1KH-YkrL_Os%2CACgb8ttkydmMdGqSwrjE8n8g8iFFwRjxWaZn1FJjGelXXApubRm2w0vJLQaUImVwl_FAwzXpRqoUn-lBpAxU_Ag&amp;pvsid=3473649948149013&amp;tmod=32352014&amp;uas=3&amp;nvt=1&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C666&amp;vis=1&amp;rsz=%7C%7CoeEbr%7C&amp;abl=CS&amp;pfx=0&amp;fu=0&amp;bc=31&amp;ifi=4&amp;uci=a!4&amp;btvi=2&amp;fsb=1&amp;xpc=AStErBxGRo&amp;p=https%3A//jessiebob1930.pixnet.net&amp;dtd=27503\" name=\"aswift_3\" width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!4\" data-google-query-id=\"CKzVwZOqy_wCFSUDXAodhCAPMw\" data-load-complete=\"true\"></iframe></div>\r\n</ins></div>\r\n</ins></div>\r\n<p>&nbsp;</p>\r\n<p>飼料的大小也適中</p>\r\n<p>雖說只是臘腸 不過太小顆依然很容易有噎到嗆到的狀況發生</p>\r\n<p>ZIWI巔峰飼料為正方形的 且大小剛剛好 讓他在吃的時候 也可以多咀嚼一下 適口性更加外 對消化道也會更加健康</p>\r\n<p>使用30~40度溫和的風將食材風乾 使用低溫不僅不會破壞食材營養 而且經數小時風乾後達到最穩定的水活性控制 讓產品品質穩定 可常溫存放</p>\r\n<p>而且肉片最適合牙齒撕、咬、啃 所以在吃飯的同時 牙齒與牙齦也會更健康</p>\r\n<p><img title=\"270126850_454400322758262_3784975756796236785_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641144049-1274611666-g_n.jpg\" alt=\"270126850_454400322758262_3784975756796236785_n.jpg\" loading=\"lazy\">&nbsp;<img title=\"270107558_2774721422821086_1157860652502531796_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641144459-273915403-g_n.jpg\" alt=\"270107558_2774721422821086_1157860652502531796_n.jpg\" loading=\"lazy\"></p>\r\n<p>不過肉含量高的飼料市面上真的也是蠻多種的</p>\r\n<p>&nbsp;但是我就決定直接幫他選擇&nbsp;<strong>寵物食品界中的王者&nbsp;巔峰全產品高達96%以上的含肉量</strong></p>\r\n<p>全部都是使用高品質的食材&nbsp;【產地】<strong>皆為100%紐西蘭食材來源</strong></p>\r\n<p>與最高規格的製程 堅持在紐西蘭生產 製造 包裝皆在紐西蘭完成 這樣也可以大大降低瑕疵品跟變質等等風險</p>\r\n<p>新鮮度當然也不用多說 絕對是最優質的<strong>人可食用品質</strong>&nbsp;及<strong>天然草飼放牧肉品</strong></p>\r\n<p><img title=\"270170120_3070549136548108_6399451668219565356_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641145038-1196261212-g_n.jpg\" alt=\"270170120_3070549136548108_6399451668219565356_n.jpg\" loading=\"lazy\"></p>\r\n<p>真的第一次看他吃飯吃這麼快的</p>\r\n<p>快到我拍起來都是模糊的!!! 就知道王者等級果真是最厲害的!!!</p>\r\n<p><img title=\"270095518_1230755570667176_6774742580916695913_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641144794-1023542879-g_n.jpg\" alt=\"270095518_1230755570667176_6774742580916695913_n.jpg\" loading=\"lazy\"></p>\r\n<p><strong>【安全認證】更是符合世界各國安全標準</strong></p>\r\n<p>巔峰全產品皆完全符合美國AAFCO，紐西蘭NZFSA、FDA、歐盟、日本等國的營養標準</p>\r\n<p>所有產品皆送往獨立實驗室檢驗 且每一批次皆留存樣本供日後追蹤問題使用 確保安心且新鮮送達世界各地</p>\r\n<p>所以毛孩的爸媽絕對可以放100顆心&nbsp; 讓你家毛孩寶貝們直接食用這款<strong>最頂級的寵物食品</strong></p>\r\n<p><img title=\"270208986_498125524949778_2583611223559196761_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641145119-1397469598-g_n.jpg\" alt=\"270208986_498125524949778_2583611223559196761_n.jpg\" loading=\"lazy\"></p>\r\n<p>巔峰比乾飼料的含水量高出1倍</p>\r\n<p>一般顆粒乾飼料為7% 巔峰則是14% 如果是家中毛孩不愛喝水的 更能夠幫助毛孩補充到水分</p>\r\n<p>ZIWI不僅營養含量高 適口性佳 且香味的部分也都是全方位遠勝一般飼料</p>\r\n<p>就算把他當成零食獎勵 他們都會愛不釋手</p>\r\n<p>這真的是完完全全一次性就直接幫我解決了困擾我很久的挑食問題</p>\r\n<p>而且他的毛色也更加的柔 更漂亮了</p>\r\n<p><img title=\"\" src=\"https://s.pixfs.net/f.pixnet.net/images/emotions/heart.gif\" alt=\"\" width=\"19\" height=\"19\" loading=\"lazy\"></p>\r\n<p><img title=\"270126858_887834325227214_1190967744815551695_n.jpg\" src=\"https://pic.pimg.tw/jessiebob1930/1641146729-347324533-g_n.jpg\" alt=\"270126858_887834325227214_1190967744815551695_n.jpg\" loading=\"lazy\"></p>\r\n<p>最後提醒大家一下 因為肉含量較高的關係</p>\r\n<p>所以所提供的也是一般顆粒的3倍熱量 相對比在罐頭及顆粒乾飼料上可以少2/3</p>\r\n<p>如果你家毛孩一天正常吃三杯的話 可以減少至一杯或一杯半</p>\r\n<p>他就既可以吃飽 也可以獲得身體所需營養及熱量的補充了哦</p>', NULL, NULL, 1, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1641140918-4187029521-g_n-fit-500.jpg\"]', '2023-01-16 05:14:00', '2023-01-16 05:35:02'),
(12, 23, '依綺品飯店~煙波大飯店宜蘭館', 3, '在孩子升上國、高中之後，出遊過夜的機會變得很少，趕在6月底暑假和國旅補助湧出人潮之前，從煙波官網訂了宜蘭煙波大飯店的住宿，在孩子結業式結束、和同學玩夠之後出發！', '<p>在孩子升上國、高中之後，出遊過夜的機會變得很少，趕在6月底暑假和國旅補助湧出人潮之前，從煙波官網訂了宜蘭煙波大飯店的住宿，在孩子結業式結束、和同學玩夠之後出發！<br><br>宜蘭煙波大飯店的特點就2個：<br>1、睡飽吃飽：從官網可以選擇6點後入住，豐盛美味的早餐可以吃到下午1點半，然後2點前退房就好，不必趕著早起吃早餐，睡到飽再去吃飽，完全符合我和女兒們的慵懶放空風格，自在悠哉。<br><br>2、網美拍照空間：宜蘭煙波離市中心有一段距離，照說應該有個游泳池健身房之類的度假設施，拍謝，都妹有，讓你不必為了住夠本而排滿使用設施的行程（沒有那種「不用可惜」的遺憾），但它有一些很美的網美拍照空間，可以讓女孩兒們拍得過癮，留下到此一遊的美照。</p>\r\n<p><img title=\"312537462_6175395379156366_2777812072551371619_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120258-1089838490-g_n.jpg\" alt=\"312537462_6175395379156366_2777812072551371619_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312797539_6175395889156315_374996686436396526_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120258-3664505740-g_n.jpg\" alt=\"312797539_6175395889156315_374996686436396526_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312921307_6175396165822954_8529191147573224231_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120261-1793131473-g_n.jpg\" alt=\"312921307_6175396165822954_8529191147573224231_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"313340364_6175395775822993_8499180043409279179_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120262-1394699760-g_n.jpg\" alt=\"313340364_6175395775822993_8499180043409279179_n.jpg\" loading=\"lazy\"></p>\r\n<p><br>我們的房型是豪華家庭房，房間很大，床也很大，床和枕頭偏軟；房內沒有浴缸，浴室和廁所是分開的，洗手台在浴廁外，人多很方便，不會浪費時間等待。浴室的沐浴乳和洗髮精是瓶裝固定式的。沒有瓶裝礦泉水，有透明水瓶，每個樓層都有飲水機，就自個兒拿水瓶去裝水，很環保。</p>\r\n<p><img title=\"312309180_6175394142489823_5010451868233617200_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120258-2128854946-g_n.jpg\" alt=\"312309180_6175394142489823_5010451868233617200_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312399826_6175396089156295_3912218505637264955_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120258-3368961713-g_n.jpg\" alt=\"312399826_6175396089156295_3912218505637264955_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312967564_6175395649156339_7622650566738579263_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120261-2417751146-g_n.jpg\" alt=\"312967564_6175395649156339_7622650566738579263_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"313369014_6175395302489707_669184728357938226_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120262-630062001-g_n.jpg\" alt=\"313369014_6175395302489707_669184728357938226_n.jpg\" loading=\"lazy\"></p>\r\n<p><br>晚上8～10點在1樓有暗黑派對，憑住宿C/I時給的券入場，可以換派派專屬小點一份，是宜蘭滷味鴨爪之類的，我不敢吃爪類，滷豆皮味道一般般，派對很無趣，大家都外帶小點回房去了。</p>\r\n<div>\r\n<div class=\"trv-player-container\">\r\n<div class=\"trv-wrapper\">\r\n<div id=\"br_video_player_0d2d0\" class=\"trvd_video_player\">\r\n<div class=\"media-player\">\r\n<div class=\"trv-video\">&nbsp;</div>\r\n<div class=\"trv-overlay\">&nbsp;</div>\r\n<div class=\"trv-media-controls\">\r\n<div class=\"trv-progress-bar\">\r\n<div class=\"trv-progress-padding\">&nbsp;</div>\r\n<div class=\"trv-buffered\">&nbsp;</div>\r\n<div class=\"trv-play-progress\">&nbsp;</div>\r\n<div class=\"trv-hover-progress\">&nbsp;</div>\r\n<div class=\"button-holder\">\r\n<div class=\"trv-progressBtn\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<button class=\"togglePlayPause brpBtn sprite-background\" title=\"Pause\" type=\"button\">Play</button><button class=\"volume brpBtn sprite-background\" title=\"volume\" type=\"button\">volume</button><span class=\"trv-currentTime\">00:13</span><span class=\"timeDivider\">/</span><span class=\"trv-duration\">05:46</span><span class=\"videoTitle\" title=\"【#部落客新聞台】吃貨不可以少的「日韓零食」！如同感情般不要勉強的蕃薯巧克力？甜鹹介紹應有盡有！feat.貝兒貪食怪\">【#部落客新聞台】吃貨不可以少的「日韓零食」！如同感情般不要勉強的蕃薯巧克力？甜鹹介紹應有盡有！feat.貝兒貪食怪</span><button class=\"BR brpBtn sprite-background\" title=\"Truvid.com\" type=\"button\">Truvid</button><button class=\"fullScreen brpBtn sprite-background\" title=\"Full Screen\" type=\"button\">fullScreen</button></div>\r\n<div class=\"video-overlay\">\r\n<div class=\"overlayBtnWrapper\">\r\n<div class=\"overlay-backwards-wrapper\">&nbsp;</div>\r\n<div class=\"overlay-play-wrapper\">&nbsp;</div>\r\n<div class=\"overlay-forward-wrapper\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p><img title=\"312059995_6175394885823082_6450993150994189535_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120255-3612565637-g_n.jpg\" alt=\"312059995_6175394885823082_6450993150994189535_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312853033_6175395145823056_1993518038709484727_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120259-3774115862-g_n.jpg\" alt=\"312853033_6175395145823056_1993518038709484727_n.jpg\" loading=\"lazy\"></p>\r\n<p>早午餐很豐盛，有現沖牛肉湯、蒜味肉羹湯、三星蔥鮮肉湯包、宜蘭鴨賞⋯誠意滿滿，讓我們飽到必須去樓上走走消化一下，頂樓可以遠眺周遭景緻，雖然沒有田園風光，但仍有心曠神怡之感（風很大），還可以看到火車（是有多愛火車？！看不膩泥～）。</p>\r\n<p><img title=\"312078978_6175394192489818_3517632852865780378_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120255-2330087821-g_n.jpg\" alt=\"312078978_6175394192489818_3517632852865780378_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"312188917_6175395719156332_3349799574714588016_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120255-1592724370-g_n.jpg\" alt=\"312188917_6175395719156332_3349799574714588016_n.jpg\" loading=\"lazy\"></p>\r\n<p><img title=\"313353665_6175395589156345_489551391500009563_n.jpg\" src=\"https://pic.pimg.tw/iris641201/1667120262-1477652215-g_n.jpg\" alt=\"313353665_6175395589156345_489551391500009563_n.jpg\" loading=\"lazy\"></p>\r\n<p>因為在我們抵達之前飯店人員就已來電表示地下停車場已滿，讓我們停在大門外，所以不知道停車場的狀況，傳說的迎賓點心也沒吃到，但可能因為我們是旺季來臨前入住，雖然電梯也等蠻久的（太小、太少、一直滿載），但整體而言是符合我們所付價格（4,050元）的C/P值，如果像網路評價上，有些人付出的是我的雙倍，而又遇到客人滿載，自然是會有不滿的，但設施方面（如：沒浴缸、洗手台在外面、沒休閒設施⋯之類的）應該是事先做過功課才訂房，而不是入住之後才抱怨。</p>', NULL, NULL, 2, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1667120261-2417751146-g_n-fit-500.jpg\"]', '2023-01-16 05:17:00', '2023-01-16 05:36:46'),
(13, 28, 'Onkyo TX-8260 數位立體聲網路串流擴大機開箱！', 3, '數位娛樂浪潮已經猶如海嘯淹沒許多人的生活，影音串流影片取代了 DVD 與藍光，線上音樂平台甚至讓 CD 以及唱片行幾乎絕跡。', '<p><a href=\"https://ifans.pixnet.net/album/photo/261653412\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (31).png\" src=\"https://pic.pimg.tw/ifans/1653414531-2685296729-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (31).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>數位娛樂浪潮已經猶如海嘯淹沒許多人的生活，影音串流影片取代了 DVD 與藍光，線上音樂平台甚至讓 CD 以及唱片行幾乎絕跡，現在許多人想在家看影片、聽音樂，轉頭看看家裡客廳那些早期買的音響設備，還真很難把手機音樂或智慧電視的訊號送進去感受往日的磅礡以及多聲道！這篇，小旭要開箱一款已經推出好一段時間，並且受到許多玩家喜愛的日系大廠「Onkyo&nbsp;TX-8260 數位立體聲網路串流擴大機」，它能讓你輕鬆將行動裝置與家庭劇院的聲音訊號，透過 Chromecast、AirPlay、Bluetooth、Wi-Fi 等無線方式或各種有線連結方式串入，也可以插入 USB 隨身碟或行動硬碟，輕鬆享受各種多元聲音來源與數位化無損音質完全不再是夢想！</p>\r\n<p>以往要購買 Onkyo&nbsp;TX-8260 這組數位立體聲網路串流擴大機，玩家必須找一些管道引進或請人海外代購，不管是購買還是保固都有點困難，現在台灣已經有代理商正式引進，購買時就可以多多注意是否為正規代理貨，以獲得完善的後續服務與完善保固，Onkyo 擴大機甚至保固兩年呢！^^</p>\r\n<p><strong>進口代理：<a href=\"https://www.huanyudigital.com.tw/\" target=\"_blank\" rel=\"noopener\">釪環數位音響有限公司</a></strong><br><strong>聯絡電話：04-23301990</strong></p>\r\n<p>訂購都可洽<a href=\"https://www.huanyudigital.com.tw/location\" target=\"_blank\" rel=\"noopener\">全台各地釪環數位特約經銷商</a></p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645044\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (2).png\" src=\"https://pic.pimg.tw/ifans/1653331946-3241529662-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (2).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>「Onkyo&nbsp;TX-8260 數位立體聲網路串流擴大機」(以下簡稱 Onkyo&nbsp;TX-8260)&nbsp;具備 Onkyo&nbsp;知名的「Optimum Gain Volume Circuitry」技術，並結合衰減器與可變增益的小信號放大電路進行音量控制，同時可帶來更低雜訊與更低的訊噪！而一開始提到內建 Google 家的 Chromecast 以及蘋果家 AirPlay 無線投放功能，還有標準 Bluetooth、Wi-Fi 與 FlareConnect、DTS Play-Fi 等無線連結功能，更是 Onkyo&nbsp;TX-8260 最大特點！</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (33).png\" src=\"https://pic.pimg.tw/ifans/1653414531-3031497380-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (33).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>在連結 Wi-Fi 無線網路後更可串接 Spotify、TIDAL，潘多拉、TuneIn 和 Deezer 等世界各地線上音樂串流媒體服務平台，不僅如此它還內建 FM/AM 收音機功能，支援 DTS Play-Fi 多室音樂播放、同網 NAS 或電腦資料夾的音樂檔案播放，最高 DSD64 (2.8MHz)/DSD128 (5.6 MHz)&nbsp; 和 192kHz/24bit PCM 等 FLAC、WAV、WMA、ALAC、DSD、AIFF、MP3 以及 AAC 等音樂格式，規格之豐富絕對不是只有「擴大機數位化」這麼簡單而已！</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (9).png\" src=\"https://pic.pimg.tw/ifans/1653331949-2705307421-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (9).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>也因此，屬於「音響麻瓜」一員的我，對於可以將各種串流平台音樂傳送到擴大機上播放，進而使用外擴的喇叭播放數位音樂，這真的太燒了！來吧～開箱 ^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645128\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (1).png\" src=\"https://pic.pimg.tw/ifans/1653331953-643178728-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (1).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>Onkyo&nbsp;TX-8260 機身前方有功能面板以及多組按鍵，看似很多且複雜，但其實操作相當簡單，黑灰色機身更是感覺相當有質感！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645052\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (7).png\" src=\"https://pic.pimg.tw/ifans/1653331946-3442155666-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (7).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>小旭個人超愛這種帶點金屬切割質感按鈕，搭配著猶如傳統擴大機的觸感與回饋度，光是在主機視覺上就完全加分！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645036\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (3).png\" src=\"https://pic.pimg.tw/ifans/1653331946-4012441043-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (3).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>前方面板左邊分別有電源鍵、鍍金 1/4 英寸 (6.35mm) 麥克風插孔、三段調光鈕、A/B 組喇叭雙聲到或四聲道的切換等按鈕！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653460\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (45).gif\" src=\"https://pic.pimg.tw/ifans/1653414541-1629602596-g.gif\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (45).gif\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>中間上方為一面功能顯示面板，可顯示當下連線模式、網路連線狀態以及操作資訊、設定資訊、功能狀態、曲目資訊 (限英文) 等等！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645056\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (8).png\" src=\"https://pic.pimg.tw/ifans/1653331948-1720703239-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (8).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>中間下方則可切換聲音輸入來源以及低音/高音/平衡控制等音效調整旋鈕！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653388\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (34).png\" src=\"https://pic.pimg.tw/ifans/1653414531-3076691200-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (34).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>面板右手邊則有一個四向選擇鍵，可在操作面板上快速選取並切換自己想要的功能選單；至於旁邊則是剛剛前面看到的大型音量旋鈕！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645040\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (5).png\" src=\"https://pic.pimg.tw/ifans/1653331946-2350596398-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (5).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>此外，右下方還有四組 BGM 以及前置 USB 連接埠 (5V/0.5A)，方便使用者連接 USB 隨身碟或外接硬碟，進而播放外接裝置內的音樂格式檔案！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645108\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (21).png\" src=\"https://pic.pimg.tw/ifans/1653331952-3292788267-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (21).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>當然，除了透過前方面板實體操作按鍵之外，Onkyo&nbsp;TX-8260 包裝內有標配一支功能相當豐富的 IR 紅外線遙控器！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645116\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (22).png\" src=\"https://pic.pimg.tw/ifans/1653331952-3062393384-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (22).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>這麼多按鈕會不會很難啊？其實不用怕啦！因為遙控器等於是把各種功能全部化身為按鈕，讓使用者可以快速切換各種不同設備來源，並且立即進行音樂播放、快轉、設定等操作！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645064\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (13).png\" src=\"https://pic.pimg.tw/ifans/1653331949-3978091988-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (13).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>機身背面，齁齁~可豐富了！密密麻麻一堆端子，幾乎可以說是要什麼有什麼，多組輸入可以讓你盡情連結各種已經入手的影音設備、電腦、遊戲機音源等等！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645076\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (11).png\" src=\"https://pic.pimg.tw/ifans/1653331949-4007962260-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (11).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>輸入部分，COAXIAL 同軸數位與 Toslink 光纖都各有兩組，二聲道類比 RCA 則有七個、FM/AM 天線孔各一組&nbsp;(接收天線於盒內配件中提供)，背後也還有一組 USB 連接埠 (5V/1A)，另外還有 RJ-45 網路端子、IR (Infra-red) 端子，甚至 MM 唱機輸入通通都有；輸出部分則有 Line Out、 Zone2 與超低音信號、耳機輸出等各一個，喇叭輸出兩個，夠豐富吧！^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645092\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (16).png\" src=\"https://pic.pimg.tw/ifans/1653331950-163286943-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (16).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>連 PHONO、CD、TV、GAME、PC、BD/DVD 等對應端子都幫你分門別類，因此透過遙控置按壓指定設備時就能快速切換對應的音源，完全省去記憶哪一個 LINE IN 接什麼設備的困擾！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645080\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (14).png\" src=\"https://pic.pimg.tw/ifans/1653331950-912695182-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (14).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>喇叭部分可連結 A/B 兩組，因此最多可連結四顆喇叭進行切換，達到兩聲道立體聲或四聲道環繞的效果，讓使用者依據聆聽內容以及情境來做不同搭配使用，例如聽人聲的喇叭、追劇的喇叭或聽古典的喇叭、聽搖滾的喇叭，四聲道一起狂奔等等！</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (15).png\" src=\"https://pic.pimg.tw/ifans/1653331950-1069555183-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (15).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>要再接其他 PREOUT 後級擴大機也行，整體連接功能相當相當完整！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645072\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (10).png\" src=\"https://pic.pimg.tw/ifans/1653331949-2420115551-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (10).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>至於機身後面的兩根天線寶寶，則是 Wi-Fi 無線網路天線，以利設備放在壁櫃內或音響櫃內時，可擁有穩定的連線品質來收聽網路串流平台音樂！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261645104\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (20).png\" src=\"https://pic.pimg.tw/ifans/1653331951-3707627203-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (20).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>Onkyo&nbsp;TX-8260 具備 160W/通道大電流放大系統，包含前面提到的豐富完整連接埠，只要搭配一組適當得宜的雙聲道喇叭，就能輕鬆在家裡聽聽音樂、看看電影，好好享受一個悠閒的午後或假日電影院啊！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653408\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (35).png\" src=\"https://pic.pimg.tw/ifans/1653414534-499983552-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (35).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>那麼，接著就來實際安裝，並看看一些常用的連結功能與應用吧！^^</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (36).png\" src=\"https://pic.pimg.tw/ifans/1653414534-2175347925-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (36).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>小旭搭配的喇叭是 KLIPSCH RP-600m 這款得獎作品，與 Onkyo&nbsp;TX-8260 連結之後，使用&nbsp;AirPlay 將 iPhone 上的 KKBOX 無損音質 Hi-Fi 真實原音播放出來，整體感受真的是超級過癮！</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (37).png\" src=\"https://pic.pimg.tw/ifans/1653414534-1018951542-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (37).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>KLIPSCH RP-600m 的聲音表現在高低層次方面非常分明，高音部分小旭個人覺得音質很細膩，最近聽江念庭的《嘸啥人知的歌星》，那種猶如蔡琴的呢喃感以及口語，整體細節非常棒，而中低音部分更有不錯的飽滿度，與 Onkyo&nbsp;TX-8260 搭配不管撥放音樂還是撥放電影都非常非常過癮！</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (40).png\" src=\"https://pic.pimg.tw/ifans/1653414536-1551733109-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (40).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>至於怎麼播放？連結電視可以漿電視的聲音透過光纖連結到&nbsp; Onkyo&nbsp;TX-8260，我相信這個部分對大部分使用者來說都不是問題！至於把手機上的音樂丟到 Onkyo&nbsp;TX-8260，這個其實並不難！</p>\r\n<p>前面有提到 Onkyo&nbsp;TX-8260 支援 Chromecast、AirPlay 與 Bluetooth、Wi-Fi 等功能，所以不管你是 Android 還是 iOS (iPhone、iPad)、Mac/MacBook 等裝置，幾乎<strong>完全不用額外安裝任何 APP</strong>，就能透過裝置手機系統內建的無線投放功能直接無線輸出 ^^</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (9).png\" src=\"https://pic.pimg.tw/ifans/1653416143-2693624806-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (9).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>例如，小旭使用 iPhone 打開 YouTube 或 YouTube Music，直接選擇要播放裝置，然後將聲音透過\"無線\"方式投到 Onkyo&nbsp;TX-8260，輕鬆簡單就能播放！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653432\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (48).gif\" src=\"https://pic.pimg.tw/ifans/1653414541-1963351775-g.gif\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (48).gif\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>整個投放操作非常簡單！一般來講有使用過手機把聲音投放到藍牙喇叭、車機的使用者，對這樣的操作模式應該都很熟悉 ^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653540\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (8).png\" src=\"https://pic.pimg.tw/ifans/1653416143-1920767997-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (8).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>KKBOX 以及 Apple&nbsp;Music 也都是一樣，只要是在同一個 WiFi 無線網路環境下，選擇無線投放裝置按一下就出去了！^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653380\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (29).png\" src=\"https://pic.pimg.tw/ifans/1653414531-292262096-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (29).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>同樣有支援&nbsp;AirPlay 的 iPad、Mac、MacBook 等等蘋果裝置，也不用額外下載 APP 就能直接使用 ^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653436\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (47).gif\" src=\"https://pic.pimg.tw/ifans/1653414541-1338474551-g.gif\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (47).gif\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>因此，只要使用你平常慣用的音樂串流平台 APP，然後直接選取播放裝置，聲音就能輕鬆送到 Onkyo&nbsp;TX-8260 上面了！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653528\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (5).png\" src=\"https://pic.pimg.tw/ifans/1653416142-3372950948-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (5).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>除了音樂串流平台等 APP 可以直接投放，這兩年很夯的 Podcast 也是打開相關 APP 就能直接無線投放！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653404\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (39).png\" src=\"https://pic.pimg.tw/ifans/1653414534-2569019113-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (39).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>如果是 Android 裝置也不用擔心！因為 Onkyo&nbsp;TX-8260 支援 Chromecast 無線連結功能，一樣可以直接使用你慣用的音樂串流 APP，然後進行無線投放！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653520\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (1).png\" src=\"https://pic.pimg.tw/ifans/1653416142-2323852619-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (1).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>不過，話說 Onkyo&nbsp;其實也有提供一個名為「Onkyo&nbsp;Controller」的 APP，只是根據我自己的使用經驗.......不下載其實也沒關係 XDDDD</p>\r\n<p>謎之音：畢竟直接打開手機上的音樂 APP 就能使用了咩，好像看來也不用再去多下載一個 APP！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653516\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (2).png\" src=\"https://pic.pimg.tw/ifans/1653416142-2046869183-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (2).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>那？這個 APP 要幹嘛咧？基本上，下載「Onkyo&nbsp;Controller」的好處，大概就是可以透過大大的圖形介面，進行如同遙控器般的各種功能切換，我能想到的大概就這樣 (會不會太殘酷) XD</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653428\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (46).gif\" src=\"https://pic.pimg.tw/ifans/1653414540-1259278205-g.gif\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (46).gif\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>也就是說，下載「Onkyo&nbsp;Controller」APP 之後，透過裡面的大型按鈕切面，可以切換不同的裝置音源或切換到你手機上安裝的音樂串流平台 APP，等於是一個設備以及音源「匯整」的目錄介面這樣！</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653440\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (43).gif\" src=\"https://pic.pimg.tw/ifans/1653414540-3817472146-g.gif\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (43).gif\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>只是啊，我在想......這些透過 APP 切換的動作，或許直接使用紅外線遙控器會快速一點！XD</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653544\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (7).png\" src=\"https://pic.pimg.tw/ifans/1653416143-1904912477-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機畫面 (ifans 林小旭) (7).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>假如真的要認真用到這個 APP，我個人覺得通常應該是突然找不到遙控器，也懶得走到音響櫃去按面板時，可以直接拿出手機來切換音樂來源，有點把安裝「Onkyo&nbsp;Controller」APP 的手機當另外一個遙控器這樣 XD</p>\r\n<p><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (41).png\" src=\"https://pic.pimg.tw/ifans/1653414536-2674934954-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (41).png\" border=\"0\" loading=\"lazy\"></p>\r\n<p>好，最後！使用 Onkyo&nbsp;TX-8260 一段時間，先來講講缺點！ Onkyo&nbsp;TX-8260 前方面板無法顯示中文曲目，這是個人比較可惜的地方 (所以中文曲目會變成 *****，英文就沒問題)，不過由於大部分這類設備都是放在音響櫃或電視櫃下方，因此是否能看到曲目好像也不是太大的困擾！</p>\r\n<p>而如果你是智慧電視的話，透過智慧電視上的各種影音 APP 或音樂串流平台，那麼音樂資訊透過電視大大畫面直接呈現曲目、封面、歌詞，好像又是比較實際且較好的呈現方式，所以不能顯示中文曲目這件事情，我一開始覺得怎麼會這樣？可是後來好像也完全覺得沒差了 XD</p>\r\n<div class=\"google-auto-placed ap_container\"><ins class=\"adsbygoogle adsbygoogle-noablate\" data-ad-format=\"auto\" data-ad-client=\"ca-pub-0496851471383904\" data-adsbygoogle-status=\"done\" data-ad-status=\"filled\">\r\n<div id=\"aswift_5_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_5\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-0496851471383904&amp;output=html&amp;h=280&amp;adk=1036791002&amp;adf=2219939784&amp;pi=t.aa~a.107396794~i.159~rp.4&amp;w=750&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846476&amp;num_ads=1&amp;rafmt=1&amp;armr=3&amp;sem=mc&amp;pwprc=3309550362&amp;ad_type=text_image&amp;format=750x280&amp;url=https%3A%2F%2Fifans.pixnet.net%2Fblog%2Fpost%2F231983437%3Futm_source%3DPIXNET%26utm_medium%3Dppage&amp;fwr=0&amp;pra=3&amp;rh=188&amp;rw=750&amp;rpe=1&amp;resp_fmts=3&amp;wgl=1&amp;fa=27&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846423438&amp;bpp=7&amp;bdt=2218&amp;idt=7&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;prev_fmts=0x0%2C180x150%2C0x0%2C1519x722%2C180x320%2C1005x124%2C180x280&amp;nras=6&amp;correlator=4648670173642&amp;frm=20&amp;pv=1&amp;ga_vid=1524087634.1673845882&amp;ga_sid=1673846422&amp;ga_hid=786449124&amp;ga_fc=1&amp;ga_cid=339004216.1673845882&amp;u_tz=480&amp;u_his=8&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=245&amp;ady=19832&amp;biw=1519&amp;bih=722&amp;scr_x=0&amp;scr_y=17031&amp;eid=44759875%2C44759926%2C44759842%2C44777876%2C31071260%2C31071010&amp;oid=2&amp;psts=ACgb8ttMpFCYNCXADvdEJ-T-bAo7ZwDxI5Ke_HOo0rpTjhqidtScbTHIcaCQ_xL3Q2ELJIa1GNRo2YvAJgdfNman0Ikx1jn1jPc38KYfORyB%2CACgb8tvfDRo4A8SrnJYkumtq_F4ukX_xFWOnC5fAba8hLxFkuNwsGvAIMY-Vaii5po5TXbmqWTA8RuW1YLaEpGhtkKsYFib5H6JHAMBKTUrSwfA&amp;pvsid=3348331196862639&amp;tmod=390707610&amp;uas=1&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=384&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C722&amp;vis=1&amp;rsz=%7C%7Cs%7C&amp;abl=NS&amp;fu=128&amp;bc=31&amp;ifi=7&amp;uci=a!7&amp;btvi=5&amp;fsb=1&amp;xpc=FfotVFErju&amp;p=https%3A//ifans.pixnet.net&amp;dtd=53169\" name=\"aswift_5\" width=\"750\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!7\" data-gtm-yt-inspected-1163015_304=\"true\" data-gtm-yt-inspected-4=\"true\" data-gtm-yt-inspected-23=\"true\" data-google-query-id=\"CM6F5oSsy_wCFeFYDwIdoKMOlg\" data-load-complete=\"true\"></iframe></div>\r\n</ins></div>\r\n<p>另外就是 Onkyo&nbsp;TX-8260 的遙控器本身使用 IR 紅外線控制，所以如果你的音響櫃或電視櫃有門片，那麼在關門之後可能會因為被遮蔽而產生無法使用遙控器的困擾，但好險這時後有「Onkyo&nbsp;Controller」APP 可以使用手機來操作 (看來還是裝上去好了)，好像又解決了一個問題，而且機身後面有 IR 孔，其實也可以另外去買延伸線，這部分真的就要看個人使用習慣了！^^</p>\r\n<p><a href=\"https://ifans.pixnet.net/album/photo/261653424\"><img title=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (42).png\" src=\"https://pic.pimg.tw/ifans/1653414537-1677240601-g.png\" alt=\"ONKYO TX-8260 雙聲道串流擴大機 (ifans 林小旭) (42).png\" border=\"0\" loading=\"lazy\"></a></p>\r\n<p>優點部分，那當然就是可以切換將手機、平板或電腦上的音樂，直接使用「無線」連結方式拋送到 Onkyo&nbsp;TX-8260 播放，而且大部分都不用額外打開「Onkyo&nbsp;Controller」這個 APP&nbsp;就能投放，真的是超級好用且相當方便！而小旭本身客廳使用的是 Smart TV 智慧電視，所以電視上已經安裝的 Disney+、YouTube、LiTV、KKTV 影音串流平台以及&nbsp;KKBOX、Spotify 音樂平台聲音，都可以從智慧電視透過光纖送到 Onkyo&nbsp;TX-8260 上面，而這之間當然也包含連結在電視 HDMI 上面的 Nintendo Switch 遊戲機，這些連結從智慧電視透過光纖送到 Onkyo&nbsp;TX-8260，連結方式也就相較更單純、更簡單！</p>\r\n<p>加上 Onkyo&nbsp;TX-8260 可以連結兩組左右聲道立體聲喇叭，因此使用時可以能依據不同情境以及需求，立即進行 A/B 組喇叭單獨切換或是四顆一起發聲，後方更有一堆堆的連接埠來讓各種設備串接其中，以這些功能、連結性以及推力來說，相信不僅可以滿足大部分居家環境使用，甚至對於一些玩家來說也是很好的數位新選擇！</p>\r\n<p>至於音質表現方面，這完全是要看你搭配的喇叭而定 (雖然喇叭的好壞不是決定在多醣體，畢竟不同的價位以及喇叭本身屬性、調性都有所不同，以小旭搭配的&nbsp;KLIPSCH RP-600m 來說，整體組合起來不僅對我來說非常過癮，也能完全滿足我的日常聽音樂以及看電影的需求，音質表現方面在前面有提到，這邊就不再重複贅述！面對如此完整且安裝上沒有太複雜的客廳神器，以上簡單開箱分享提供給你參考，希望對你有幫助，如果還有疑問的話，都歡迎在底下留言唷！^^</p>\r\n<p><strong>延伸閱讀：</strong></p>\r\n<p><strong>進口代理：釪環數位音響有限公司 (<a href=\"https://www.facebook.com/Klipsch.tw/\" target=\"_blank\" rel=\"noopener\">粉絲團點這邊</a>) (<a href=\"https://www.huanyudigital.com.tw/\" target=\"_blank\" rel=\"noopener\">官網點這邊</a>)</strong><br><strong>聯絡電話：04-23301990</strong></p>\r\n<p>訂購都可洽<a href=\"https://www.huanyudigital.com.tw/location\" target=\"_blank\" rel=\"noopener\">全台各地釪環數位特約經銷商</a></p>\r\n<p><strong>歡迎訂閱與支持：<a href=\"https://linkby.tw/ifans\" target=\"_blank\" rel=\"noopener\">https://linkby.tw/ifans</a></strong></p>\r\n<p><strong>小旭的部落格：<a href=\"https://ifans.pixnet.net/blog\" target=\"_blank\" rel=\"noopener\">https://ifans.pixnet.net/blog</a><br>小旭的 YouTube：&nbsp;<a href=\"https://www.youtube.com/c/ifansblog\" target=\"_blank\" rel=\"noopener\">https://www.youtube.com/c/ifansblog</a></strong><br><strong>小旭的 臉書粉絲團：<a href=\"https://www.facebook.com/search/top/?q=ifans\" target=\"_blank\" rel=\"noopener\">https://www.facebook.com/search/top/?q=ifans</a>&nbsp;<br>小旭的 IG：<a href=\"https://www.instagram.com/ifans_blog/\" target=\"_blank\" rel=\"noopener\">https://www.instagram.com/ifans_blog/</a>&nbsp;<br>小旭的 Clubhouse：@ifans3c&nbsp;<br>小旭的&nbsp;twitter：<a href=\"https://twitter.com/ifans_blog\" target=\"_blank\" rel=\"noopener\">https://twitter.com/ifans_blog<br></a>還有「科技酷宅」Podcast：<a href=\"https://podcasts.apple.com/tw/podcast/id1446542592\" target=\"_blank\" rel=\"noopener\">https://podcasts.apple.com/tw/podcast/id1446542592</a></strong></p>\r\n<p><strong>如果您覺得這一篇文章對您有幫助，可否為我按個讚或加入 ifans 家族粉絲團呢 ^^</strong></p>', NULL, NULL, 3, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1653414531-2685296729-g-fit-500.png\"]', '2023-01-16 05:22:00', '2023-01-16 05:35:51');
