(14, 24, '新開幕1700坪商場！全台最美甜水果專賣店，蔬菜7樣200元。', 3, '全台最美甜水果專賣店，就是這間心苑農場，超高CP值蔬菜7樣200元、水果玉米筍32支100元，專業尋菓師挑選新鮮好水果，享受貴婦級美學購物，價格卻是超便宜！', '<p><strong>心苑農場/大地商場</strong></p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617353653_49a460ec37_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<center>\r\n<div id=\"aswift_0_host\" tabindex=\"0\" title=\"Advertisement\" data-ad-slot=\"4996917960\" aria-label=\"Advertisement\" data-ad-status=\"filled\"><iframe id=\"aswift_0\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=90&amp;slotname=4996917960&amp;adk=1497495950&amp;adf=1449505741&amp;pi=t.ma~as.4996917960&amp;w=728&amp;lmt=1673846553&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449992691305813&amp;h_ch=7999488453&amp;wgl=1&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846553085&amp;bpp=18&amp;bdt=285&amp;idt=294&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=5&amp;saldr=sa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;correlator=8288998812326&amp;frm=20&amp;pv=2&amp;ga_vid=339004216.1673845882&amp;ga_sid=1673846553&amp;ga_hid=1653966555&amp;ga_fc=1&amp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=139&amp;ady=1037&amp;biw=1519&amp;bih=722&amp;scr_x=0&amp;scr_y=0&amp;eid=44759875%2C44759926%2C44759842%2C44779794&amp;oid=2&amp;pvsid=99647230848624&amp;tmod=691487876&amp;uas=0&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C722&amp;vis=1&amp;rsz=%7C%7CoEebr%7C&amp;abl=CS&amp;pfx=0&amp;fu=0&amp;bc=31&amp;ifi=1&amp;uci=a!1&amp;btvi=1&amp;fsb=1&amp;xpc=GrQLArA7IT&amp;p=https%3A//mercury0314.pixnet.net&amp;dtd=312\" name=\"aswift_0\" width=\"728\" height=\"90\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!1\" data-google-query-id=\"CLDvsqmsy_wCFQIIXAodvhsMAw\" data-load-complete=\"true\"></iframe></div>\r\n</center>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>全台最美甜水果專賣店，就是這間<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>，超高CP值蔬菜7樣200元、水果玉米筍32支100元，專業尋菓師挑選新鮮好水果，享受貴婦級美學購物，價格卻是超便宜！</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356502_a78f85fae0_b.jpg\" alt=\"心苑農場 大地商場\" width=\"600\" height=\"900\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>位於台中北屯<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">大地商場</a>A41櫃，由2大設計師「苾花芫」與「雲手美術」聯手打造，原木溫潤質感搭配玻璃窗框，沒有用到一支鐵釘，攤位上還停了30隻木雕鳥，可以仔細尋找看看。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356497_b7d8bbeca0_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>販售甜水果和新鮮蔬菜，攤位設計美到爆炸，買菜也能很時尚很優雅！偶像劇完全可以來這裡拍攝，想像男女主角邂逅場景，拿起同一包蔬菜牽起緣分XD</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617300330_14a9ac93bd_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>做好品質把關，每日限量銷售。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617300315_2d8d91b67f_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_1_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_1\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=2453298308&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846838&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449992691305813&amp;h_ch=7999488453&amp;fwr=0&amp;rpe=1&amp;resp_fmts=3&amp;wgl=1&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846553176&amp;bpp=37&amp;bdt=376&amp;idt=243&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;prev_slotnames=4996917960&amp;nras=3&amp;correlator=8288998812326&amp;pv_h_ch=7999488453&amp;frm=20&amp;pv=1&amp;ga_vid=339004216.1673845882&amp;ga_sid=1673846553&amp;ga_hid=1653966555&amp;ga_fc=1&amp;ga_cid=1524087634.1673845882&amp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=100&amp;ady=4174&amp;biw=1519&amp;bih=722&amp;scr_x=0&amp;scr_y=1317&amp;eid=44759875%2C44759926%2C44759842%2C44779794&amp;oid=2&amp;psts=ACgb8tsxDuwTPh9l2_kmsyKfBpEXWoWHl16UJ7fETgaODl_sPem7pMu5CdQYlwoyUb8bMZoWlts1OzU1QD4nMZI%2CACgb8tsKlY9jh1VwOIW9vj4P91h2bfPzZKUhsGc_e3SdlDe7u9B4xidMOwhPtlCufQCHTjTU6dgdnHtqlsskFDD5FJAfPvhgxCzZWLFRlFi0Xkc&amp;pvsid=99647230848624&amp;tmod=32352014&amp;uas=3&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C722&amp;vis=1&amp;rsz=%7C%7CoeEbr%7C&amp;abl=CS&amp;pfx=0&amp;fu=128&amp;bc=31&amp;ifi=2&amp;uci=a!2&amp;btvi=3&amp;fsb=1&amp;xpc=2kKSPumH5Q&amp;p=https%3A//mercury0314.pixnet.net&amp;dtd=M\" name=\"aswift_1\" width=\"805\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!2\" data-google-query-id=\"CIzAkrGty_wCFRQMXAod7RgBtA\" data-load-complete=\"true\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>千萬別以為這麼有設計質感的農場，賣得蔬果葉菜就會很貴很貴。你看看這水果玉米筍32支100元！真的超值划算，一整年均有販售，而且價格固定，中秋節也不會漲價。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617300295_2884ec7355_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>由專業農夫種植，保持整支玉米筍原型，避免參差不齊的來源。每支水果玉米筍剝開都很漂亮，甜度非常高。我們買回家，將玉米筍前後頭切掉，放電鍋半杯水、蒸一蒸就可以剝殼食用，裡面的玉米鬚也可以吃。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617300260_b2710b5636_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>還有這區也很划算！蔬菜7樣200元！平均一包只要28點多元，實在好便宜，而且一眼望去都是高單價蔬菜，種類非常豐富，選擇很多，任意搭配。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356337_ba16bddb60_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>每包的單價，和連鎖超市不相上下，有些甚至更物超所值。包裝也特別針對2-4人小家庭，獨立分裝乾淨衛生，買回去不用花時間處理，清水洗洗就能料理食用。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356322_620e091710_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>超受歡迎的歐式生菜，可以直接當沙拉來吃，市面價至少50、60元，<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>配起來只要約28元，很快就賣完，晚來買不到。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617353443_349dfe0399_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_2_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_2\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=4235417991&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846839&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449