escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!3\" data-google-query-id=\"CLjig7Kty_wCFQEDXAodO5wMxg\" data-load-complete=\"true\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>平常有在買菜的朋友就知道，新鮮水蓮不便宜，這裡同樣可搭7樣200元，而且這包的重量絕對超過連鎖超市、還更便宜。難怪很多外縣市朋友都指定要逛，大老遠跑來也值得。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617353433_1280b8e20d_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>在<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>買菜很有安全感，不僅蔬菜品質有專人把關，價格也都公開透明、平價、公道，不會有秤重後被菜價嚇到的情況。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617131439_69410e769b_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>因應現代人飲食習慣改變，特地準備不一樣的食材，像是水果系列蔬菜，高山櫛瓜、水果小黃瓜、水果玉米筍、水果彩椒、水果絲瓜，這些都是可以做異國風味料理的食材，直接生吃或簡單烹調，不需要大火熱炒，更能保留蔬菜營養。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356162_ac1404335c_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>這是Baby四季豆、甜豆，在營養價值最高峰的生長期新鮮採摘，吃起來特別嫩，很好入口。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356137_1021896277_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>仔細看這是青江菜baby-青江苗，超級無敵嫩！只需要汆燙20、30秒就熟了，或是煮泡麵時放進去熱水燜一下就可以吃。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616864286_f6a5a1b668_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_3_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_3\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=3264694797&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846841&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449992691305813&amp;h_ch=7999488453&amp;fwr=0&amp;rpe=1&amp;resp_fmts=3&amp;wgl=1&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846553214&amp;bpp=1&amp;bdt=414&amp;idt=376&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;prev_fmts=805x280%2C805x280&amp;prev_slotnames=4996917960&amp;nras=3&amp;correlator=8288998812326&amp;pv_h_ch=7999488453&amp;frm=20&amp;pv=1&amp;ga_vid=339004216.1673845882&amp;ga_sid=1673846553&amp;ga_hid=1653966555&amp;ga_fc=1&amp;ga_cid=1524087634.1673845882&amp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=100&amp;ady=11230&amp;biw=1519&amp;bih=722&amp;scr_x=0&amp;scr_y=8385&amp;eid=44759875%2C44759926%2C44759842%2C44779794&amp;oid=2&amp;psts=ACgb8tsxDuwTPh9l2_kmsyKfBpEXWoWHl16UJ7fET