mg title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616356042_7ddbe69b65_b.jpg\" alt=\"心苑農場 大地商場\" width=\"600\" height=\"900\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>有專屬木製推車，享受採購的生活美學儀式感，特別有溫度。來這裡買菜就像是貴婦，但其實菜價非常便宜，CP值超高。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617353178_95129ce822_b.jpg\" alt=\"心苑農場 大地商場\" width=\"600\" height=\"900\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>不只是我們這種料理小白安心購買，豐富經驗的家庭主婦也都一試成主顧。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617353108_e5586efdf7_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_4_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_4\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=3786900128&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846842&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449992691305813&amp;h_ch=7999488453&amp;fwr=0&amp;rpe=1&amp;resp_fmts=3&amp;wgl=1&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846553215&amp;bpp=1&amp;bdt=415&amp;idt=587&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp