\n<p>&nbsp;</p>\r\n<p>熟客一來就說「我今天要宴客」專業店員推薦最新蔬果，分享料理方式，晚上就能輕鬆端出整桌豐盛好菜。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616864166_68fd96a386_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"584\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>先來分享我們今天的部分戰利品，有生菜、奶油白菜、日本圓茄、水蓮、高山櫛瓜、糖果椒、娃娃菜，全部加起來只要200元。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616864126_260a99871f_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>想買到好吃水果不踩雷，其實比買菜更高難度，<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>自稱「甜水果專賣店」，掛保證讓大家安心買。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617131189_d36bce0371_b.jpg\" alt=\"心苑農場 大地商場\" width=\"600\" height=\"800\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>以專業尋菓師之姿，尋尋覓覓找到最好最甜的。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617299800_7705610e3b_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>在日本發光的集集山蕉，口感又香又Q，清楚標記出每串價格。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617131154_a0626978e6_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_5_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_5\" src=\"https://googleads.g.doubleclick.net/pagea