7Sty_wCFYkKXAodFZYNWA\" data-load-complete=\"true\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>的每種水果都好吃，有感受到店家的用心挑選，我們買回去一下子就被家人吃光光。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616355752_c6021118ab_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>除了蔬菜、甜水果之外，還有年輕雞媽媽剛生的土雞蛋，經過<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>嚴格篩選裝盒，帶回家冷藏可放30天。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616863936_c4d92615b1_b.jpg\" alt=\"心苑農場 大地商場\" width=\"600\" height=\"900\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>結帳可使用LINE Pay付款，現場門市購買(不包含宅配)滿百元有1點，集滿10點還可換3包大葉菜類。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617299610_b6649f180e_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">心苑農場</a>門市座落地點為<a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">大地商場</a>，佔地1700坪，位於敦富路及敦富一街口，總站夜市斜對面，舊社捷運站左轉2分鐘即可抵達。商場設有專屬停車場，汽機車停車位非常多。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617352853_dc2a69209e_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\">大地商場</a>以「美學市場x 餐桌食堂x青農創想」為出發，結合了餐飲品牌搭配在地青農生鮮、假日生活市集。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616863916_af104cc434_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_7_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_7\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=1484920270&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846846&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%25b4&amp;region=test&amp;host=ca-host-pub-7449992691305813&amp;h_ch=7999488453&amp;fwr=0&amp;rpe=1&amp;resp_fmts=3&amp;wgl=1&amp;uach=WyJXaW5kb3dzIiwiMTAuMC4wIiwieDg2IiwiIiwiMTA5LjAuNTQxNC43NCIsW10sZmFsc2UsbnVsbCwiNjQiLFtbIk5vdF9BIEJyYW5kIiwiOTkuMC4wLjAiXSxbIkdvb2dsZSBDaHJvbWUiLCIxMDkuMC41NDE0Ljc0Il0sWyJDaHJvbWl1bSIsIjEwOS4wLjU0MTQuNzQiXV0sZmFsc2Vd&amp;dt=1673846553300&amp;bpp=1&amp;bdt=499&amp;idt=933&amp;shv=r20230111&amp;mjsv=m202212050101&amp;ptt=9&amp;saldr=aa&amp;abxe=1&amp;cookie=ID%3Dc08e01c83a6931e6-228391cd50d90092%3AT%3D1673845881%3AS%3DALNI_MaOD8ooXWcH6ojU-MA-0jtRHO2yug&amp;gpic=UID%3D00000ba5377e91fd%3AT%3D1673845881%3ART%3D1673845881%3AS%3DALNI_MbfrUfxkqqKhe_udsoSEaqk3eb_9Q&amp;prev_fmts=805x280%2C805x280%2C805x280%2C805x280%2C805x280%2C805x280&amp;prev_slotnames=4996917960&amp;nras=3&amp;correlator=8288998812326&amp;pv_h_ch=7999488453&amp;frm=20&amp;pv=1&amp;ga_vid=339004216.1673845882&amp;ga_sid=1673846553&amp;ga_hid=1653966555&amp;ga_fc=1&amp;ga_cid=1524087634.1673845882&amp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=100&amp;ady=26394&amp;biw=1519&amp;bih=722&amp;scr_x=0&amp;scr_y=23530&amp;eid=44759875%2C44759926%2C44759842%2C44779794&amp;oid=2&amp;psts=ACgb8tsxDuwTPh9l2_kmsyKfBpEXWoWHl16UJ7fETgaODl_sPem7pMu5CdQYlwoyUb8bMZoWlts1OzU1QD4nMZI%2CACgb8tsKlY9jh1VwOIW9vj4P91h2bfPzZKUhsGc_e3SdlDe7u9B4xidMOwhPtlCufQCHTjTU6dgdnHtqlsskFDD5FJAfPvhgxCzZWLFRlFi0Xkc%2CACgb8tvOeqHKXVPUS_SrChRfzEVI8iOPxtl8IBry7YB6HHcFZCFHzBy4IzhnHT_R22V0WVjKThqnRuOH0fwncA%2CACgb8tulYsUO0mbQhM_QKt0xi1A8R5GFpGq7Eq9bNog1VildzYJ9wEUalOfJ-O1B9UiXqmufOztOkJOQq3wqHQ%2CACgb8tuOWQKsXdAzoJCiSiHKCs3uxFijyXf41Y7kcA-m1CVxMBfSStYgxhfDjHVXgVSQ2qmm8XYi7_tHgD7Tvebq%2CACgb8ttHXs-RuBtIGNkfHtQCxUj4YDTeKmNnxDpiZet6upeXzuW1nW4qe4C4w0gfSnz41psPavHHtDpqqafppK2J%2CACgb8ttu_DMIIsvx4cUUL6BiUv3Ga9aH8CsE7fzuYVzg_b1yZYeFRoFKxTwGPWbwEuOMKvnek8o_eDKabnkk5YY%2CACgb8tulcxWextPy-oM7ZAfXshHc13CgoKMf6F-512zCoHDbQTKNiP_WNbrzi_bSp76Sugn2n4zqevupLAaMc9g0CQ&amp;pvsid=99647230848624&amp;tmod=32352014&amp;uas=1&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C722&amp;vis=1&amp;rsz=%7C%7CoeEbr%7C&amp;abl=CS&amp;pfx=0&amp;fu=128&amp;bc=31&amp;ifi=8&amp;uci=a!8&amp;btvi=11&amp;fsb=1&amp;xpc=5U2lQcFZhQ&amp;p=https%3A//mercury0314.pixnet.net&amp;dtd=M\" name=\"aswift_7\" width=\"805\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!8\" data-google-query-id=\"COeToLWty_wCFQkNXAodzToEZQ\" data-load-complete=\"true\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>北屯一日遊必逛景點，繽紛彩繪的大地長頸鹿，可以來當網美打卡。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617299555_89773b605d_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>保有傳統市場的人情味，空間乾淨明亮，美食區提供巨大原木長桌，感覺就像一家人聚在一起的食堂，充滿溫馨氛圍。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617299535_6d12196f7f_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>這裡打造出北屯舊社美食生活圈，預計招募50家異國美食餐飲品牌，想必未來會更加熱鬧。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616863846_c68de06b9a_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"534\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>大地商場還有很多遊樂設施，旋轉木馬、咖啡杯、小火車、海盜船等，很適合親子共趣來用餐、購物、玩樂。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617130939_b59578edc9_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<p>假日還可以來逛市集，文創商品、服飾、烘焙甜點、農產品都有，散發濃濃文青味，有時候也會有街頭藝人表演。</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52616355567_7f95fc72a8_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"533\" loading=\"lazy\"></a></p>\r\n<p>&nbsp;</p>\r\n<div id=\"aswift_8_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_8\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-4958007660428293&amp;output=html&amp;h=280&amp;slotname=6473651160&amp;adk=3683904987&amp;adf=1913325797&amp;pi=t.ma~as.6473651160&amp;w=805&amp;fwrn=4&amp;fwrnh=100&amp;lmt=1673846847&amp;rafmt=1&amp;format=805x280&amp;url=https%3A%2F%2Fmercury0314.pixnet.net%2Fblog%2Fpost%2F568492356-%25e5%25bf%2583%25e8%258b%2591%25e8%25be%25b2%25e5%25a0%2