n4zqevupLAaMc9g0CQ%2CACgb8tvMhQ4ImHqsbf4HA9Vx2izLNABGWnDKvILs24N5Tg_YruvA0SXB0VX06uNlo8kGt1_r7VKqjJ_F1D8K2JFOzw&amp;pvsid=99647230848624&amp;tmod=32352014&amp;uas=1&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C722&amp;vis=1&amp;rsz=%7C%7CoeEbr%7C&amp;abl=CS&amp;pfx=0&amp;fu=128&amp;bc=31&amp;ifi=9&amp;uci=a!9&amp;btvi=12&amp;fsb=1&amp;xpc=vrEcygLwmH&amp;p=https%3A//mercury0314.pixnet.net&amp;dtd=M\" name=\"aswift_8\" width=\"805\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!9\" data-google-query-id=\"CJbk3bWty_wCFSUDXAodhCAPMw\" data-load-complete=\"true\"></iframe></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>整體心得：老實說我們原本看心苑農場的裝潢和蔬果精緻度，還以為會非常高價位，貴婦才買得起那種，結果價格竟然很親民，真的是兼具顏值和CP值，大家不用望之卻步！而且大地商場有得吃有得玩，非常值得來走走～</p>\r\n<p><a href=\"https://mercury0314.pixnet.net/blog/post/568492356\" target=\"_blank\" rel=\"noopener\"><img title=\"心苑農場 大地商場\" src=\"https://live.staticflickr.com/65535/52617352768_1e787224ab_b.jpg\" alt=\"心苑農場 大地商場\" width=\"800\" height=\"419\" loading=\"lazy\"></a></p>\r\n<div>\r\n<p><strong>心苑農場-北屯門市</strong><br>地址：台中市北屯區敦富一街133號<br>(大地商場-A41櫃)<br>營業時間：13:00-18:00，週一公休<br>粉絲團：<a href=\"https://www.facebook.com/profile.php?id=100063562346763\" target=\"_blank\" rel=\"noopener\"><u>心苑農場</u></a><br>Line：<a href=\"https://lin.ee/ZmQRExN\" target=\"_blank\" rel=\"noopener\"><u>https://lin.ee/ZmQRExN</u></a></p>\r\n<p><strong>心苑農場-西區門市</strong><br>地址：台中市西區健行路1049號<br>(金典綠園道-第六市場32櫃)<br>營業時間：11:00-18:00，週一公休</p>\r\n<p><strong>大地商場</strong><br>交通：台中捷運舊社站，出口左轉<br>粉絲團：<a href=\"http://facebook.com/greatlandsquare\" target=\"_blank\" rel=\"noopener\"><u>facebook.com/greatlandsquare</u></a></p>\r\n</div>', NULL, NULL, 5, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/52617353653_49a460ec37_b-fit-500.jpg\"]', '2023-01-16 05:28:00', '2023-01-16 05:35:10');
INSERT INTO `articles` (`id`, `cgy_id`, `title`, `author_id`, `content_small`, `content`, `attachment_names`, `attachment_paths`, `sort`, `status`, `featured`, `meta_description`, `meta_keywords`, `seo_title`, `slug`, `pic`, `created_at`, `updated_at`) VALUES
(15, 26, '瑞典發現歐洲最大稀土礦床：10年後可開採，可望減少對中國依賴', 3, '瑞典國有礦業公司LKAB表示，在該國最北部的基律納地區發現了超過100萬噸的稀土元素沉積物，是目前歐洲已知最大的同類礦床。', '<h3>基律納地區發現歐洲最大礦床，稀土元素與生活息息相關</h3>\r\n<p>瑞典國有礦業公司<a title=\"LKAB\" href=\"https://lkab.com/en/press/europes-largest-deposit-of-rare-earth-metals-is-located-in-the-kiruna-area/\" target=\"_blank\" rel=\"noopener\">LKAB</a>週四表示，在該國最北部的基律納地區（the Kiruna area）發現了超過100萬噸的稀土元素沉積物，是目前歐洲已知最大的同類礦床。而這些稀土元素對製造智慧型手機、電動汽車、風力渦輪機乃至於國防方面的導彈巡航系統都至關重要。</p>\r\n<p><a title=\"《美聯社》\" href=\"https://apnews.com/article/china-sweden-europe-business-climate-and-environment-962efd20602a9cfa2d4e164e7ee450b8\" target=\"_blank\" rel=\"noopener\">《美聯社》</a>指出，稀土攸關每個人的生活，它們對於快速成長的綠色能源領域和電動汽車發動機也非常重要。但歐盟在市場上遠遠落後於競爭對手，大約98%的稀土礦產來自中國。<a title=\"《德國之聲》\" href=\"https://www.dw.com/zh/%E5%88%B6%E7%BE%8E%E7%8E%8B%E7%89%8C%E7%99%BB%E5%9C%BA-%E4%B8%AD%E5%9B%BD%E5%A8%81%E8%83%81%E7%A8%80%E5%9C%9F%E5%8F%8D%E5%87%BB/a-48843963\" target=\"_blank\" rel=\"noopener\">《德國之聲》</a>也指出，中國擁有全球37%的稀土礦藏，幾乎沒有其他稀土供應方有同樣的競爭力。</p>\r\n<h3>開採的過程漫長艱辛</h3>\r\n<p>據LKAB稱，公司將於今年提交開發特許權的申請，預計至少需要10年時間來調查盈利並評估開採的條件。LKAB目前已經準備在現有的基律納礦井中向新礦床靠近，以便進一步調查採礦條件。</p>\r\n<p>執行長珍蒙斯托姆（Jan Mostr&ouml;m）表示正在進行大量投資，同時對土地利用抱持謙卑態度，盡可能避免負面影響。</p>\r\n<p><a title=\"《路透社》\" href=\"https://www.reuters.com/markets/commodities/swedens-lkab-finds-europes-biggest-deposit-rare-earth-metals-2023-01-12/\" target=\"_blank\" rel=\"noopener\">《路透社》</a>報導也指出，人類行動往往會影響所在地區的水資源和生物多樣性，因此北歐國家在批准新礦物開採的過程往往漫長而艱辛。</p>\r\n<h3>歐洲正值綠色能源轉型，渴望擺脫進口牽制</h3>\r\n<p><a title=\"《路透社》\" href=\"https://www.reuters.com/markets/commodities/swedens-lkab-finds-europes-biggest-deposit-rare-earth-metals-2023-01-12/\" target=\"_blank\" rel=\"noopener\">《路透社》</a>引述瑞典地質調查局礦產資源部的地質學家艾瑞克強森（Erik Jonsson）的說法表示，歐洲目前缺乏加工稀土金屬和製造中間產品的完整能力。他說：「我們還需要關注這些金屬整體的價值鏈，例如我們想用於風力渦輪機或電動汽車發動機的高效磁鐵。」</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p6_special-3\" class=\"ad-section__content\" data-google-query-id=\"CIjyxt2vy_wCFdRBDwIdWmUMKg\">\r\n<div id=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0__container__\" class=\"parent_hk_thenewslens_curation_desktop_middle_tw\">\r\n<div id=\"gliaplayer-hk_thenewslens_curation_desktop_middle_tw-1673847469504-1955975131-container\" class=\"gliaplayer-container account_hk_thenewslens slot_hk_thenewslens_curation_desktop_middle_tw slot_undefined ad-playing gliaplayer-float\" data-slot=\"hk_thenewslens_curation_desktop_middle_tw\" data-article=\"www.thenewslens.com.my\" data-test-id=\"gliaplayer-container\" data-player-mounted=\"\">\r\n<div class=\"gliaplayer-container-aspect\">\r\n<div class=\"gliaplayer-wrapper\" data-ref=\"wrapper\" data-test-id=\"gliaplayer-wrapper\">\r\n<div id=\"gliaplayer-hk_thenewslens_curation_desktop_middle_tw-1673847469504-1955975131\" class=\"gliaplayer\" data-ref=\"player\" data-test-id=\"gliaplayer-player\" data-arb-aspect-ratio=\"1.7777777777777777\" data-arb-resize-mode=\"horizontal\">\r\n<div id=\"el-8665707886\">\r\n<div id=\"el-209857557\" class=\"dailymotion-player-root dailymotion-player-x9yc1\">\r\n<div class=\"dailymotion-player-wrapper\"><iframe class=\"dailymotion-player\" src=\"https://geo.dailymotion.com/player/x9yc1.html?video=k6S8js4bbo1Ei8ywYm1&amp;mute=true&amp;scaleMode=fit&amp;syndication=276265\" width=\"100%\" height=\"100%\" frameborder=\"0\" allow=\"autoplay; fullscreen; picture-in-picture\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"ImaAd-module_root_2DAhA\" data-ref=\"imaAd\" data-status=\"adStarted\" data-ad-unit-group-order=\"10\" data-ad-unit-group-id=\"undefined\">\r\n<div class=\"ImaAd-module_ad-container_3jKnP\" data-ref=\"imaAdContainer\" data-test-id=\"ima-ad-container\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class=\"CloseButton_root_1G7QW\" data-shape=\"square\" data-test-id=\"gliaplayer-unfloat-button\" data-ref=\"unfloatButton\">\r\n<div class=\"CloseButton_button_3QT-R\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>據<a title=\"《美聯社》\" href=\"https://apnews.com/article/china-sweden-europe-business-climate-and-environment-962efd20602a9cfa2d4e164e7ee450b8\" target=\"_blank\" rel=\"noopener\">《美聯社》</a>報導，歐盟委員會（European Commission）的資料顯示，由於歐盟正值經濟上數位和綠色轉型，稀土需求到2030年將成長5倍。</p>\r\n<p>內部市場專員蒂埃里布雷頓（Thierry Breton）亦提出警告，如果沒有安全、可持續地獲得原料，歐盟想成為首個氣候中和大陸的雄心壯志將面臨風險。他說：「過去一年中，中國稀土和永久磁鐵的價格就上漲了50-90%。原料供應已然成為地緣政治工具。」</p>\r\n<p>歐盟也渴望從過去吸取教訓，減少對俄羅斯石油和天然氣的片面依賴。日前直到2月24日莫斯科的全面入侵烏克蘭後，歐盟才開始切斷關係。瑞典工業部長艾芭布希（Ebba Busch）在此一探勘後稱瑞典為「金礦」。他說：「這必須改變。短期目標是實現貿易多樣化，但從長遠來看，我們不能只依靠貿易協議。 歐盟若要真正脫離中國和俄羅斯的牽制達到自給自足，就必須仰賴礦物開採。」</p>\r\n<h3>新聞來源</h3>\r\n<ul>\r\n<li><a title=\"Sweden\'s LKAB finds Europe\'s biggest deposit of rare earth metals（Reuters）\" href=\"https://www.reuters.com/markets/commodities/swedens-lkab-finds-europes-biggest-deposit-rare-earth-metals-2023-01-12/\" target=\"_blank\" rel=\"noopener\">Sweden\'s LKAB finds Europe\'s biggest deposit of rare earth metals（Reuters）</a></li>\r\n<li><a title=\"China note! EU-member Sweden locates rare earth deposits（AP News）\" href=\"https://apnews.com/article/china-sweden-europe-business-climate-and-environment-962efd20602a9cfa2d4e164e7ee450b8\" target=\"_blank\" rel=\"noopener\">China note! EU-member Sweden locates rare earth deposits（AP News）</a></li>\r\n<li><a title=\"Europe&rsquo;s largest deposit of rare earth metals is located in the Kiruna area（LKAB）\" href=\"https://lkab.com/en/press/europes-largest-deposit-of-rare-earth-metals-is-located-in-the-kiruna-area/\" target=\"_blank\" rel=\"noopener\">Europe&rsquo;s largest deposit of rare earth metals is located in the Kiruna area（LKAB）</a></li>\r\n<li><a title=\"制美王牌登場? 中国威脅稀土反擊（德國之聲）\" href=\"https://www.dw.com/zh/%E5%88%B6%E7%BE%8E%E7%8E%8B%E7%89%8C%E7%99%BB%E5%9C%BA-%E4%B8%AD%E5%9B%BD%E5%A8%81%E8%83%81%E7%A8%80%E5%9C%9F%E5%8F%8D%E5%87%BB/a-48843963\" target=\"_blank\" rel=\"noopener\">制美王牌登場? 中国威脅稀土反擊（德國之聲）</a></li>\r\n</ul>\r\n<h3>延伸閱讀</h3>\r\n<ul>\r\n<li><a title=\"擔心烏俄戰爭衝擊過量下單，「歐洲用」液化天然氣沒地方儲存、35艘載運船被迫停在海上\" href=\"https://www.thenewslens.com/article/175269\" target=\"_blank\" rel=\"noopener\">擔心烏俄戰爭衝擊過量下單，「歐洲用」液化天然氣沒地方儲存、35艘載運船被迫停在海上</a></li>\r\n<li><a title=\"歐洲降低對俄能源依賴，普亭與艾爾多安協議在土耳其設天然氣中心\" href=\"https://www.thenewslens.com/article/175139\" target=\"_blank\" rel=\"noopener\">歐洲降低對俄能源依賴，普亭與艾爾多安協議在土耳其設天然氣中心</a></li>\r\n<li><a title=\"「最糟糕情況還沒到來」 ，IMF警告全球經濟前景的四個重點\" href=\"https://www.thenewslens.com/article/174838\" target=\"_blank\" rel=\"noopener\">「最糟糕情況還沒到來」 ，IMF警告全球經濟前景的四個重點</a></li>\r\n<li><a title=\"為什麼「歐洲這個冬天會凍死人」是胡説八道：俄羅斯將如何輸掉能源戰？\" href=\"https://www.thenewslens.com/article/174103\" target=\"_blank\" rel=\"noopener\">為什麼「歐洲這個冬天會凍死人」是胡説八道：俄羅斯將如何輸掉能源戰？</a></li>\r\n<li><a title=\"北溪一號與二號天然氣管線疑遭人為破壞，是誰做的？外媒分析一次看\" href=\"https://www.thenewslens.com/article/174084\" target=\"_blank\" rel=\"noopener\">北溪一號與二號天然氣管線疑遭人為破壞，是誰做的？外媒分析一次看</a></li>\r\n</ul>\r\n<p>【加入關鍵評論網會員】每天精彩好文直送你的信箱，每週獨享編輯精選、時事精選、藝文週報等特製電子報。還可留言與作者、記者、編輯討論文章內容。<a title=\"立刻點擊免費加入會員！\" href=\"https://www.thenewslens.com/profile/subscribe?utm_source=article&amp;utm_medium=CTA&amp;utm_campaign=member\" target=\"_blank\" rel=\"noopener\">立刻點擊免費加入會員！</a></p>', NULL, NULL, 4, 'draft', 1, NULL, NULL, NULL, NULL, '[\"articles/1ywwoqngmvtpa65uj9aomdjhbo1jwy-fit-500.jpg\"]', '2023-01-16 05:40:00', '2023-01-16 12:55:47'),
(16, 27, '如何維繫遠距離戀愛？網友熱議5大方式，讓你保持戀愛溫度', 3, '對戀人來說「遠距離戀愛」是感情中的一大考驗，許多人擔心彼此的感情會因分隔兩地而導致戀情無疾而終。', '<p>對戀人來說「遠距離戀愛」是感情中的一大考驗，許多人擔心彼此的感情會因分隔兩地而導致戀情無疾而終，究竟要如何避免因為物理距離而使感情產生間隙，順利克服遠距離的酸楚及問題呢？現在就一起來看看網友熱議的維繫方式有哪些吧！</p>\r\n<p>《Social Lab社群實驗室》本次透過《OpView社群口碑資料庫》追蹤近一年內「遠距離戀愛」話題的網路聲量表現，帶您了解網友熱議的維持遠距離戀愛熱度的方式有哪些。</p>\r\n<h2><strong>不常見面但要「保持聯絡」 「多充實自己」勿將另一伴當作生活重心</strong></h2>\r\n<p>觀察近一年內網友針對「遠距離戀愛」相關話題的討論，可以發現「保持溝通、聯絡」受到網友最熱烈的討論。有網友提到，雙方身處異地，當生活上遇到困難需要伴侶幫助時，無法馬上出現在對方身邊，因此可以透過保持良好的溝通與聯繫來給予伴侶情感上的支持與陪伴；也有網友分享過往異國戀愛的經驗，「我原本是個很愛冷戰的人，總想等見面才解決問題，但異國戀能見面的機會很少，有爭執一定要好好向對方溝通，不然會成為感情的致命傷」，不少網友看了也紛紛在文章留言處表示贊同。</p>\r\n<figure class=\"fig-cont include-image\">\r\n<div class=\"image-wrapper image-wrapper-withsizes\"><img class=\" lazyloaded\" src=\"https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644\" srcset=\"https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644 375w, https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644 768w, https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w1200 1200w\" alt=\"\" data-hashid=\"0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw\" data-width=\"3336\" data-height=\"2191\" data-srcset=\"https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644 375w, https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644 768w, https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w1200 1200w\" data-src=\"https://obs.line-scdn.net/0h8KUcvaZLZ2RoGnLCRHgYM1BMaxVbfH1tSih_UE4dbVARNnQzAHw0B0oca0hMLSVlSHl8Vh4fbQBMLCVlBw/w644\" data-expand=\"300\">\r\n<div class=\"placeholder\">&nbsp;</div>\r\n</div>\r\n<figcaption>▲TOP 5 維持遠距離戀愛的方法 網路聲量排行</figcaption>\r\n</figure>\r\n<p>此外，「充實自己的生活」也是維繫異地戀的好方法。有兩性專家發文提到，「遠距離戀愛首先要培養成熟獨立的人格」，要接受另一伴無法時常陪伴身邊的事實，能獨自面對生活及學會獨處，建議要能跳脫過往舒適圈，多方去探索自己的興趣或是參加進修的課程，重新分配過去與伴侶相處的時間，多花時間陪伴家人、朋友，豐富自己的生活，既能轉移伴侶不在身邊的空虛孤獨感，還能促使自我成長更增添戀愛中的個人魅力，吸引網友於底下留言「推，正在進行中，保持自我生活，反而讓彼此產生一種距離美」、「有自己的生活步調，才能避免遠距離戀愛的不安全感」。</p>\r\n<p>另一方面，有網友提到伴侶間建立共同的默契及目標也十分重要。像是「規劃共同未來、創造專屬互動模式」，都能讓彼此產生更深刻的連結。鄉民們在感情版說道「遠距離交往時，因對未來感到越不確定，容易使關係缺乏信任感，後來發現透過訂定共同目標，像是見面日期、一起旅遊的假期等，讓彼此有具體期待的事情，能有效安撫見不到面焦躁的情緒。」</p>\r\n<p>遠距離戀愛不全然是壞事，有較多的自我空間和時間，不常見面兩人也許會更珍惜下次的相處時光，看完網友們熱議的遠距離戀愛維持方式，你是否對維持異地戀更有信心呢？</p>\r\n<p><strong><em><a href=\"http://www.social-lab.cc/?utm_source=Linetoday&amp;utm_medium=social&amp;utm_campaign=recommend\" target=\"_blank\" rel=\"noopener\">觀看更多OpView口碑分析報告</a></em></strong></p>', NULL, NULL, 6, 'draft', 1, NULL, NULL, NULL, NULL, 'articles/315314182_2716885061775772_3107775117230886425_n-fit-500.jpg', '2023-01-16 05:44:00', '2023-01-16 06:32:19'),
(17, 28, '【AI繪圖時代】創意工作者會不會被人工智慧取代？設計師如何培養AI圖像溝通技能？', 3, '2022年被稱為「AI繪圖元年」，如果創造性工作也被AI取代，那人類的價值還剩什麼？', '<p>2022年被稱為「AI繪圖元年」。</p>\r\n<p>隨著AI繪圖工具Midjourney、Stable Diffusion、NovelAI等在2022下半年逐步開放群眾測試，只要輸入幾個關鍵字便能快速產生圖像，人人都能進行創作，AI圖像在台灣網路社群開始流行；而9月初，&nbsp;<a title=\"傑森．艾倫（Jason Allen）的Midjourney畫作《Th&eacute;&acirc;tre D\'op&eacute;ra Spatial》獲得美國科羅拉多州博覽會數位藝術類首獎\" href=\"https://www.thenewslens.com/article/172691\" target=\"_blank\" rel=\"noopener\">傑森．艾倫（Jason Allen）的Midjourney畫作《Th&eacute;&acirc;tre D\'op&eacute;ra Spatial》獲得美國科羅拉多州博覽會數位藝術類首獎</a>，則是將AI繪圖推向爭端。</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p2-2\" class=\"ad-section__content\" data-google-query-id=\"CIXSnbKxy_wCFd1VDwId7h4L_g\">\r\n<div id=\"google_ads_iframe_/21870649235/tnl_a_p2_0__container__\">當時艾倫高喊：「人工智慧贏了，人類輸了。」許多人的疑問與擔憂是，如果創造性工作也被機器取代，那人類的價值還剩什麼？</div>\r\n</div>\r\n</div>\r\n<h3>如何使用AI繪圖工具？</h3>\r\n<p>輸入「/imagine」和提示字（prompt），幾秒內AI就能幫你產出四張圖。聽起來容易，但如果僅止於此，你很有可能會對AI繪圖工具產生的結果感到相當失望。</p>\r\n<p>不同的AI繪圖工具擅長的圖像類型迥異，例如NovelAI擅長二次元，Dall-E較為擬真，而Midjourney最具藝術性，擅長抽象圖像、油畫、動漫和模型等，因此，在創作之前必須先熟悉AI工具的特性，創作結果才比較能符合期待。設計師／AI圖像溝通師林自庠比喻，不同的畫家專業領域不同，若要求一位油畫家完成鉛筆畫，也許不至於無法詮釋，但很可能與期待的品質有所差距，而AI繪畫工具也是如此。</p>\r\n<p>不同的AI繪圖工具對提示字的要求與詮釋也不盡相同。</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p6_special-3\" class=\"ad-section__content\" data-google-query-id=\"CMLBnbKxy_wCFRpMDwIdVmgH0g\">\r\n<div id=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0__container__\"><iframe id=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0\" tabindex=\"0\" title=\"3rd party ad content\" role=\"region\" name=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0\" width=\"1\" height=\"1\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" aria-label=\"Advertisement\" data-load-complete=\"true\" data-google-container-id=\"3\"></iframe></div>\r\n<div class=\"AV62b1d407ca3a836d05636515\">\r\n<div id=\"aniBox\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673847914809\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673847914809Wrapper\" class=\"avp-p-wrapper av-floating\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673847914809Container\">\r\n<div id=\"content_1575064331\"><video src=\"https://content1.avplayer.com/58fcbed1073ef420086c9d08/videos/6304d63d067b0c1abf0fddb6/6304d6aaa47ebba45d028593/video.mp4?AV_TAGID=62b1d407ca3a836d05636515&amp;AV_TEMPID=62b1d2936f86fa0ac2372849&amp;cid=62b1d2e9d08b594f6e7042a4&amp;pid=624c9625ddd86c139e378795&amp;AV_PUBLISHERID=624c9625ddd86c139e378795&amp;av_qd1=6304d7c9f22bb9e2cb0252a2&amp;videoId=6304d63d067b0c1abf0fddb6\" muted=\"true\" width=\"400\" height=\"225\"></video></div>\r\n<div class=\"avp-p-gui ads-mode\" data-id=\"gui_796417318\" data-avp-mobile=\"false\" data-avp-width=\"400\" data-avp-height=\"225\" data-avp-theme=\"default\" data-theme-color=\"#ff0000\" data-avp-ui-size=\"xs\">\r\n<div class=\"avp-p-gui-b avp-hidden\">\r\n<div class=\"avp-p-dk avp-pos-abs\">AI藝術創作者鳥巢說明，由於Midjourney官方期望提示字言簡意賅，因此寫在越前面的提示字越影響圖像生成效果。此外，對比Stable Diffusion能夠接受更精準的提示字，生成的圖像更貼近提示字描述與創作者的需求，使用Midjourney進行創作則較考驗運氣，「所以我們才會自稱『召喚師』，召喚出的結果有點隨機的成分。」</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>擁有六個月Midjourney使用經驗的玩家李怡志則認為，利用AI工具生成圖像是一個「解構再建構」的過程，使用者將期待的畫面拆解成文字描述，再交給AI進行演算重新組合圖像，考驗使用者與AI「有效溝通」的技巧，「使用者需要知道AI聽得懂什麼、聽不懂什麼，接著再去修改語彙表達給AI。」</p>\r\n<p>因此，「如何撰寫提示字」成為AI圖像創作者、玩家們最需要深入研究的課題，也正是使用AI繪圖工具的專業所在。</p>\r\n<p>觀摩他人的作品、測試提示字效果是AI圖像創作者、玩家們的日常作業；而Midjourney本身的使用介面、AI繪圖工具的官網藝廊、Lexica等提示字網站以及AI圖像創作社群，都是提示字的學習資源。</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p10-4\" class=\"ad-section__content\" data-google-query-id=\"CKjrnbKxy_wCFVBGDwIdwqAKTA\">\r\n<div id=\"google_ads_iframe_/21870649235/tnl_a_p10_0__container__\">林自庠表示，平時要保持「玩」的習慣，在大量嘗試的過程中便能漸漸掌握AI工具對提示字的理解程度以及可以設定、調整的幅度。李怡志舉例，在參考、大量測試提示字後發現，若想透過Midjourney生成「人在水中」的圖像，使用「underwater photography」的效果遠比其他提示字效果更好、更穩定。鳥巢則是透露，從接觸AI繪圖工具至今，他每天至少花費10小時進行圖像創作與提示字研究。</div>\r\n</div>\r\n</div>\r\n<p>不過，現階段AI工具仍各自的弱點與局限。最令Midjourney使用者詬病的是，手部幾乎無法完美成像；而筆者使用Nijijourney則發現，儘管提示字要求二次元女孩子穿著長褲，演算的成品仍然僅能呈現短裙加長襪。</p>\r\n<div class=\"self-html\">\r\n<figure class=\"op-social embed-responsive\"><iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fani3small.meme%2Fposts%2Fpfbid0464vW78NVUEQqyg7UEQDCfhEpYu6dq8ei7eViGs8qMQRnGijj8fH24HYJ3EPPajRl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"659\" frameborder=\"0\" scrolling=\"no\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"allowfullscreen\"></iframe></figure>\r\n</div>\r\n<h3>創意工作應用AI繪圖工具，打造「人類－AI創意循環」</h3>\r\n<p>2022年11月底，台灣遊戲公司雷亞公開招募「AI美術設計師／AI溝通師」協助利用AI工具使開發專案更有效率地進行。雷亞遊戲執行長暨共同創辦人游名揚在12月22日舉行的AI詠唱者忘年會（第0屆AIGC年會）中談到：「我認為AI將會成為創意產業的開發主流，它與人類之間存在十倍到一百倍的開發差異，產業內清楚這件事情。」</p>\r\n<p>AI最大的優勢在於生產速度快，在非常短時間內產出大量視覺內容，而這樣的特性正在改變設計工作的流程與效率。</p>\r\n<p>鳥巢說明，過往業主將設計需求告訴設計師、插畫師，一個星期後才能看到圖像內容，有時還會覺得不太滿意、與預期成果還有一段差距，再花費時間進行修改。但使用AI工具進行設計，即使它生成圖像不符期待，也不再需要等一個禮拜才能修改，而是隨時都能快速調整，「AI它太快了，我可以一直重下提示字，Midjourney一分鐘可以產12張圖。」</p>\r\n<p>李怡志認為，如果設計師善於使用AI繪圖工具，他便能將業主的需求及時轉譯給AI、快速打樣，透過AI生成的圖像確認雙方對設計內容的共識，「以前室內設計跟業主溝通時用筆畫半天，現在1、2分鐘內就根據你的字出一個大樣，30分鐘內出10個給業主參考不成問題。」</p>\r\n<p>AI能將業主或設計師腦中的想像快速地轉化為實際的畫面，也能幾乎無成本地、輕鬆地嘗試各種創意。林自庠認為，AI工具能夠幫助設計者獲取更多的靈感、進行腦力激盪；鳥巢也說：「『概念發想』正是AI很重要的特性與優勢。」</p>\r\n<p>鳥巢曾受公仔設計公司委託，使用AI工具進行公仔設計概念發想。只需透過特定提示字控制AI生成公仔圖像，其餘設計則是鳥巢天馬行空地想像、透過提示字描述畫面元素，由AI負責快速且有品質地完成視覺內容；每天10張圖、連續20天，一共200張概念圖便能供公仔設計公司挑選、參考，再進一步設計公仔樣式。</p>\r\n<div class=\"self-html\">\r\n<figure class=\"op-social embed-responsive\"><iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2Fjosefhsu%2Fposts%2Fpfbid02YcVW1ZzEcQAo3NyLy9FBxEwdSDetANShUU6ru9J8UEgkyYbs9TaauCsx5hn8yPsrl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"667\" frameborder=\"0\" scrolling=\"no\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"allowfullscreen\"></iframe></figure>\r\n</div>\r\n<p>此外，AI也能幫助設計師獲取所需設計素材。林自庠表示，平時從事包裝設計常仰賴素材網站中的既有素材，內容有限也不具獨特性，而AI工具不僅能夠彌補圖庫的不足，將原本不存在的素材生成出來，還能根據設計主體生成客製化的素材。</p>\r\n<div class=\"self-html\">\r\n<figure class=\"op-social embed-responsive\"><iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FYY0110%2Fposts%2Fpfbid036qWmL2XCjAVvz7NTHkqjt7B2FJpEjcgNDmQcb9n4RxJEHsAjM9Wm6XHeWsdbLxnrl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"709\" frameborder=\"0\" scrolling=\"no\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\" allowfullscreen=\"allowfullscreen\"></iframe></figure>\r\n</div>\r\n<p>「即使目前需要用到AI的設計案不多，但我還是會在整理業主的需求過後，去思考AI能夠幫助我做到什麼。」林自庠分享，比起懼怕AI繪圖工具的應用，更多的是期待將AI工具融入設計師的日常工作之中。</p>\r\n<p>鳥巢強調，設計師不必擔心被AI取代，設計師真正的專業在於腦中的創意點子、在於依循業主的需求進行創作的本領，這些是AI還無法取代的。維吉尼亞大學電腦科學系新任助理教授郭彥伶也在AI詠唱者忘年會（第0屆AIGC年會）中提到，AI的產出容易因演算模型的設計而趨向大眾偏好，也難以融入創作者個人的獨特經驗，「缺乏原創性」是當前AI難以突破、改善的限制。</p>\r\n<p>不過，郭彥伶仍期許，人類與AI能夠共創正向的創意循環。鳥巢說明，目前AI的優勢在於它的「廣度」，AI匯集幾億人的美學，能夠幫助人類快速地進行前期的設計概念發想，拓展人類對於視覺內容的想像；而人類則是以「精細度」為優勢，憑藉個人的特色調整視覺內容，利用自身在特定繪畫領域、設計主題中長時間累積而來的經驗將圖像畫得更精細、更考究，「人類、AI結合不是很好嗎？」</p>\r\n<hr>\r\n<h3>五款熱門的AI繪圖工具</h3>\r\n<p><strong>Midjourney</strong>，點擊<a title=\"連結\" href=\"https://discord.gg/midjourney\" target=\"_blank\" rel=\"noopener\">連結</a>進入Discord，在對話框輸入「/imagine prompt: 」與提示字便能得到圖片。每隻Discord帳號擁有25張免費試用額度；付費方案採訂閱制，依服務內容而有不同價格，每月最低10美元。</p>\r\n<p><strong>Nijijourney</strong>，點擊<a title=\"連結\" href=\"https://discord.com/invite/nijijourney\" target=\"_blank\" rel=\"noopener\">連結</a>進入Discord，或是直接在Midjourney提示字中輸入「--niji」。提示字接受英文、日文、韓文及簡體中文，使用方式與Midjourney相同。免費試用與付費訂閱制度與Midjourney相同。</p>\r\n<p><strong>Stable Diffusion</strong>，代碼和模型都完全開源，可以<a title=\"免費下載\" href=\"https://dbzer0.itch.io/lucid-creations\" target=\"_blank\" rel=\"noopener\">免費下載</a>並安裝在自己的裝置上；近期也提供<a title=\"網頁版\" href=\"https://stablediffusionweb.com/\" target=\"_blank\" rel=\"noopener\">網頁版</a>服務，輸入文字按下「Generate image」按鈕即可獲得圖片。</p>\r\n<p><strong>Dalle-E2</strong>，點擊<a title=\"連結\" href=\"https://openai.com/dall-e-2/\" target=\"_blank\" rel=\"noopener\">連結</a>並以電子郵件帳號登入即可使用，輸入文字並按下「Generate」按鈕即可獲得圖片，或是上傳既有圖片，重新演算整個或部分圖像內容。首月擁有50張免費額度，次月起每月15張免費額度；付費算圖購買額度，最低15美金。</p>\r\n<p><strong>NovelAI</strong>，點擊<a title=\"連結\" href=\"https://novelai.net/stories\" target=\"_blank\" rel=\"noopener\">連結</a>註冊帳號、登入使用介面，提供文字生成及圖象生成服務。目前不提供免費額度，收費最低一個月10美元。</p>\r\n<p>【加入關鍵評論網會員】每天精彩好文直送你的信箱，每週獨享編輯精選、時事精選、藝文週報等特製電子報。還可留言與作者、記者、編輯討論文章內容。<a title=\"立刻點擊免費加入會員！\" href=\"https://www.thenewslens.com/profile/subscribe?utm_source=article&amp;utm_medium=CTA&amp;utm_campaign=member\" target=\"_blank\" rel=\"noopener\">立刻點擊免費加入會員！</a></p>\r\n<p>責任編輯：朱家儀<br>核稿編輯：翁世航</p>', NULL, NULL, 7, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/315314182_2716885061775772_3107775117230886425_n-fit-500.jpg\"]', '2023-01-16 05:51:12', '2023-01-16 05:51:12'),
(18, 14, '有心血管疾病可以做重量訓練嗎？高強度運動心跳太快怎麼辦？', 3, '進入健身房後就像是照妖鏡，如果沒有評估自己身體狀況，貿然從事高強度運動，像是重量訓練、飛輪等，承受較大運動壓力下，平日沒有發作的病徵...', '<p>記得剛進健身房的時候，健身房教練有問過小青：「你是剛剛開始接觸健身嗎？是不是以前都沒有規律的運動習慣？」其實教練會這樣問是有原因的，有些學員剛開始課程時，自認體能良好，熱身後就開始高強度運動，在中途時突然感到胸悶不適、呼吸困難，尤其心臟砰砰直跳，更甚者有心口疼痛的症狀，讓學員心生恐懼懷疑自己是否有心臟方面的問題。</p>\r\n<p>今天小青來健身房問教練這個問題，教練說這要從頭開始解釋起。現在許多人平日工作生活多屬靜態為多，如果平日沒有規律運動習慣的話，其實很難發現自己是否有心臟血管方面的問題，時間久了會讓這問題長期被忽視。</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p2-2\" class=\"ad-section__content\" data-google-query-id=\"CMyF9vCyy_wCFUdHDwIdgfwLuw\"></div>\r\n</div>\r\n<p>然而進入健身房後就像是照妖鏡，如果沒有評估自己身體狀況，貿然從事高強度運動，像是重量訓練、飛輪等，承受較大運動壓力下，平日沒有發作的病徵，這時心臟負擔變大、增加耗氧量，假使有血管阻塞情況，激烈運動會讓心肌缺氧情況變得更明顯，這就是誘發這情況的原因。</p>\r\n<p>為了避免因為突然運動誘發心臟及相關併發疾病等風險，醫師建議男性約在35－45歲、女生在40－50歲間，就要開始養成定期心血管健檢的習慣。這是為什麼呢？其實心血管疾病都是好發在50歲以上的中年人居多，心臟科醫師表示台灣年輕人抽菸比例太高，門診曾經遇過39歲男性上班族，工作忙碌又經常熬夜加班，習慣性靠著抽菸來紓壓，直到某日心肌梗塞發作，才驚覺健康情況下滑。</p>\r\n<p>今日不少年輕人的血壓、血脂都比往日同齡相較比例更高，卻不願意按照醫囑服藥控制，當危險因子控制不佳時，心血管疾病當然就找上門。醫師建議男性超過40歲、女性停經之後就可以開始心臟方面的健檢，這年齡層的人往往因為工作忙碌忽略檢查，更是需要注意的族群。特別是有心臟病家族史的朋友，假使經濟許可，35歲以後就可以開始。</p>\r\n<p>有哪些是需要檢查的項目呢？ 首先是基本的動脈硬化指數檢查，了解自身與同年紀的族群比較心血管動脈硬化風險高低；其次，運動心電圖和心臟超音波也可列入檢查項目。透過運動心電圖檢測，顯示你的心肌是否有足夠氧氣提供，診斷是否有心律不整等心臟疾病相關風險；心臟超音波檢查是看心臟的結構，檢測有沒有瓣膜性心臟病或心臟衰竭問題。</p>\r\n<div class=\"ad-section\">\r\n<div id=\"gpt-tnl_a_p6_special-3\" class=\"ad-section__content\" data-google-query-id=\"COGG9vCyy_wCFYtLDwIdlcUCwA\">\r\n<div id=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0__container__\"><iframe id=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0\" tabindex=\"0\" title=\"3rd party ad content\" role=\"region\" name=\"google_ads_iframe_/21870649235/tnl_a_p6_special_0\" width=\"1\" height=\"1\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" aria-label=\"Advertisement\" data-load-complete=\"true\" data-google-container-id=\"3\"></iframe></div>\r\n<div class=\"AV62b1d407ca3a836d05636515\">\r\n<div id=\"aniBox\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673848314719\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673848314719Wrapper\" class=\"avp-p-wrapper av-floating\">\r\n<div id=\"aniplayer_AV62b1d407ca3a836d05636515-1673848314719Container\">\r\n<div id=\"content_1397459295\"><video src=\"https://content1.avplayer.com/58fcbed1073ef420086c9d08/videos/6304d63e067b0c1abf0fddb9/6304d6d785e51fc355009a93/video.mp4?AV_TAGID=62b1d407ca3a836d05636515&amp;AV_TEMPID=62b1d2936f86fa0ac2372849&amp;cid=62b1d2e9d08b594f6e7042a4&amp;pid=624c9625ddd86c139e378795&amp;AV_PUBLISHERID=624c9625ddd86c139e378795&amp;av_qd1=6304d7c9f22bb9e2cb0252a2&amp;videoId=6304d63e067b0c1abf0fddb9\" muted=\"true\" width=\"400\" height=\"225\"></video></div>\r\n<div class=\"avp-p-gui\" data-id=\"gui_562615724\" data-avp-mobile=\"false\" data-avp-width=\"400\" data-avp-height=\"225\" data-avp-theme=\"default\" data-theme-color=\"#ff0000\" data-avp-ui-size=\"xs\">\r\n<div class=\"avp-p-gui-b avp-hidden\">&nbsp;</div>\r\n<div class=\"avp-p-gui-m\">\r\n<div class=\"avp-p-cn-sec-bnext avp-pos-abs avp-btn avp-hidden\">那如果檢查有這方面問題，是不是就要放棄運動了呢？倒也不需要這麼灰心，假使真有心血管疾病，或高血壓及肥胖的族群，首先要避免高衝擊運動，如舉重、爬樓梯、仰臥起坐等會瞬間增加心跳量的運動，盡可能避免血壓爆衝的危險。運動前也最好做足暖身運動的準備，讓身體及心臟逐漸適應運動帶來的身體變化。</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>以下為私人教練建議幾個運動原則給有類似困擾的塑身朋友，您可以斟酌參考使用。</p>\r\n<h3>教練建議的運動種類：漸進式原則</h3>\r\n<p><strong>一、運動種類</strong>：建議從事肌力訓練、柔軟度、心肺運動。</p>\r\n<p><strong>二、運動強度建議</strong>：</p>\r\n<ul>\r\n<li>心肺運動：最大心跳＝220－年齡（以1分鐘為單位），一般運動強度的建議是最大心跳數的 60％至 80％的範圍間為最佳。</li>\r\n<li>肌力訓練：感覺到肌肉微微發酸的程度就可以停止。</li>\r\n<li>柔軟度訓練：稍微感覺到緊繃但是不到疼痛的程度。</li>\r\n</ul>\r\n<p><strong>三、運動頻率建議</strong>：心肺運動每週5次，肌力訓練每週2－3次，柔軟度每週3－5次。</p>\r\n<p><strong>四、每次持續時間建議</strong>：心肺運動30分鐘以上，柔軟度15－30秒，肌力訓練8－15下／3組。</p>\r\n<p>這樣的運動方式有什麼好處呢？首先對於心臟血管的負擔比較小，不會增加額外的壓力，當然這個只是基本原則，每個人的情況、體質都不同，最好的方式是把你的情況詳細告知，讓你的教練幫忙在不同階段調整強度。</p>\r\n<p>飲食方面就要比平常更花心思一點，假設女性一天如果完全沒有運動的情況，<a title=\"新陳代謝\" href=\"https://superfit.com.tw/all/metabolism-and-bmr/\" target=\"_blank\" rel=\"noopener\">新陳代謝</a>所需攝取總熱量大約是1300大卡左右，其中碳水化合物與飽和性脂肪的比例都要控制在10％以內，也就是各130大卡，這樣對於心血管的壓力也比較小。</p>\r\n<p>那如果被確診有心血管疾病的朋友，能夠做什麼運動呢？還是可以從事重量訓練，不過是要在醫師的監督與建議之下，可以每週做一到二次不連續的重量訓練（間隔1到2天比較適合） ，讓肌肉在重量訓練之後得到休息、修補並且強化的時間。也可以<a title=\"搭配有氧運動\" href=\"https://superfit.com.tw/all/aerobic-and-anaerobic/\" target=\"_blank\" rel=\"noopener\">搭配有氧運動</a>，每次30分鐘，一週累計做150分鐘，也能達到維持良好生活型態的運動需求，從內到外改善基礎健康狀態。</p>\r\n<p>等到慢慢適應之後，徵詢過醫師建議後，請教練慢慢增加訓練菜單，包括啞鈴、舉重等重量訓練可增加肌耐力及肌肉比例的動作，逐漸提高身體能量的消耗、代謝，這樣才能在安全範圍內達成塑身減重的目標。當然還是建議在專業健身教練指導下循序漸進鍛鍊，才能避免不必要的受傷風險。</p>\r\n<p>說了這麼多注意事項，絕不是要讓有這方面病徵的朋友產生恐懼、或是止步不前、放棄雕塑身體的想法，而是要重新認識自己身體的狀態，從事安全有效並在專業人士指導下的活動。雖然聽起來麻煩很多，但是為了自己的健康著想，千萬不要做出超出自己身體負荷範圍的運動，以免危及生命安全。</p>\r\n<p>本文經<a title=\"SuperFit\" href=\"https://www.facebook.com/superfit.tw/\" target=\"_blank\" rel=\"noopener\">SuperFit</a>授權轉載，原文<a title=\"刊載於此\" href=\"https://superfit.com.tw/workout/heartbeat-too-fast/\" target=\"_blank\" rel=\"noopener\">刊載於此</a></p>\r\n<h3>延伸閱讀</h3>\r\n<ul>\r\n<li><a dir=\"ltr\" title=\"如何分辨運動後的「痛爽感」是正常痠痛，還是肌肉拉傷？ \" href=\"https://www.thenewslens.com/article/94574\" target=\"_blank\" rel=\"noopener\" data-ctorig=\"https://www.thenewslens.com/article/94574\" data-cturl=\"https://www.google.com/url?client=internal-element-cse&amp;cx=ffbec494da84adc97&amp;q=https://www.thenewslens.com/article/94574&amp;sa=U&amp;ved=2ahUKEwiSq7WT8ub7AhXTy4sBHbavCNUQFnoECAEQAg&amp;usg=AOvVaw3gN9bsyrsjwiYV7V2Lvd2s\">如何分辨運動後的「痛爽感」是正常痠痛，還是肌肉拉傷？</a></li>\r\n<li><a dir=\"ltr\" title=\"柔術醫師談疼痛：有病可不可以去運動？ \" href=\"https://www.thenewslens.com/article/90626\" target=\"_blank\" rel=\"noopener\" data-ctorig=\"https://www.thenewslens.com/article/90626\" data-cturl=\"https://www.google.com/url?client=internal-element-cse&amp;cx=ffbec494da84adc97&amp;q=https://www.thenewslens.com/article/90626&amp;sa=U&amp;ved=2ahUKEwiSq7WT8ub7AhXTy4sBHbavCNUQFnoECAkQAg&amp;usg=AOvVaw0vnAlZQOKCdXezoqAK4SbB\">柔術醫師談疼痛：有病可不可以去運動？</a></li>\r\n<li><a dir=\"ltr\" title=\"確診康復解隔離後，可以直接回歸到之前的訓練菜單嗎？\" href=\"https://www.thenewslens.com/article/171869\" target=\"_blank\" rel=\"noopener\" data-ctorig=\"https://www.thenewslens.com/article/171869\" data-cturl=\"https://www.google.com/url?client=internal-element-cse&amp;cx=ffbec494da84adc97&amp;q=https://www.thenewslens.com/article/171869&amp;sa=U&amp;ved=2ahUKEwiSq7WT8ub7AhXTy4sBHbavCNUQFnoECAIQAg&amp;usg=AOvVaw2GJjDrzj5oyYIcJ5YXWEyG\">確診康復解隔離後，可以直接回歸到之前的訓練菜單嗎？</a></li>\r\n</ul>\r\n<p>【加入關鍵評論網會員】每天精彩好文直送你的信箱，每週獨享編輯精選、時事精選、藝文週報等特製電子報。還可留言與作者、記者、編輯討論文章內容。立刻點擊免費加入會員！</p>\r\n<p>責任編輯：朱家儀<br>核稿編輯：翁世航</p>', NULL, NULL, 8, 'online', 1, NULL, NULL, NULL, NULL, '', '2023-01-16 05:54:02', '2023-01-16 05:54:02'),
(19, 23, '《戀愛+旅行│甜蜜·蜜月行｜環島旅程-花蓮住宿篇 Part2》', 3, '第二晚入住位於市區花蓮門諾醫院旁的【花蓮翰品酒店】遠遠的就可以看到一棟彩色外觀的飯店走近一看處處是童趣...', '<p>走近一看處處是童趣</p>\r\n<p>【花蓮翰品酒店】和幾米合作</p>\r\n<p>室內室外都有幾米的裝置藝術</p>\r\n<p>這篇一樣幫大家分類為四區</p>\r\n<p>一起來看看吧!!</p>\r\n<h2 id=\"h2-0\">大廳區</h2>\r\n<p>因為位於市區，佔地較小</p>\r\n<p>Lobby不走氣派路線，改走溫馨路線</p>\r\n<p>這也跟【花蓮翰品酒店】標榜是親子飯店有關係</p>\r\n<p>撇除冷冰冰的水晶吊燈</p>\r\n<p>換上幾米的裝置藝術，連我都要尖叫了..</p>\r\n<p>這也太可愛了吧</p>\r\n<p>(呆呆維: 阿妳就小朋友阿~曾三歲😏😏)</p>\r\n<p>左下跟又下的那兩張照片</p>\r\n<p>地上的琴鍵真的可以彈出聲音喔!!</p>\r\n<p>超酷的👍👍</p>\r\n<p><img title=\"S__35209293.jpg\" src=\"https://pic.pimg.tw/debbyt5407/1668409057-667384567-g_l.jpg\" alt=\"S__35209293.jpg\" loading=\"lazy\"></p>\r\n<h2 id=\"h2-1\">戶外區</h2>\r\n<p>飯店雖然不大</p>\r\n<p>但該有的設施也沒少喔</p>\r\n<p>看看這戶外的大游泳池</p>\r\n<p>暑氣都少一半了</p>\r\n<p>現場會有一位救生員，還有很多造型的游泳圈可供租借喔</p>\r\n<p>如果帶小朋友來，應該可以耗上一下午，放電成功😆😆</p>\r\n<p><img title=\"S__35209291.jpg\" src=\"https://pic.pimg.tw/debbyt5407/1668409072-4217927789-g_l.jpg\" alt=\"S__35209291.jpg\" loading=\"lazy\"></p>\r\n<h2 id=\"h2-2\">房間區</h2>\r\n<p>房間不算大，中規中矩的</p>\r\n<p>附上繡有翰品英文字樣的浴袍</p>\r\n<p>一樣住在高樓層，看出去是寬闊的街景</p>\r\n<p>整體而言~乾淨舒服</p>\r\n<p><img title=\"S__35209295.jpg\" src=\"https://pic.pimg.tw/debbyt5407/1668409072-2359985202-g_l.jpg\" alt=\"S__35209295.jpg\" width=\"400\" height=\"400\" loading=\"lazy\"></p>\r\n<h2 id=\"h2-3\">壽星專案</h2>\r\n<p>這次來住翰品的亮點就是他們提供的「壽星方案」</p>\r\n<div class=\"article-inread-ad mib-ad-box\" data-adindex=\"1\"><ins class=\"adsbyfalcon pixnet-ad\" data-ad-client=\"1\" data-ad-slot=\"3542\" data-embed=\"false\" data-merge-position=\"3342\" data-adsbyfalcon-status=\"done\">\r\n<div id=\"pixad3342\"></div>\r\n<div id=\"scupio-pixnet_4108_18154_18818_content\"><iframe id=\"scupio-pixnet_4108_18154_18818_content_frame_registed\" width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe></div>\r\n</ins></div>\r\n<p>&nbsp;</p>\r\n<p>只要是當月壽星</p>\r\n<p>都可以使用這個方案</p>\r\n<p>除了價格優惠外</p>\r\n<p>還會附上</p>\r\n<ol>\r\n<li>紅酒和兩個紅酒杯 ( 還有冰桶喔)</li>\r\n<li>房間布置: 充氣生日熊+兩頂壽星帽</li>\r\n<li>冰箱還有一個小小的海綿蛋糕</li>\r\n</ol>\r\n<p><img title=\"S__35209294.jpg\" src=\"https://pic.pimg.tw/debbyt5407/1668409072-148165412-g_l.jpg\" alt=\"S__35209294.jpg\" width=\"400\" height=\"400\" loading=\"lazy\"></p>\r\n<p>總體而言</p>\r\n<p>【花蓮翰品酒店】走的是一種溫馨的感覺</p>\r\n<p>飯店內的燈光大多都設定為昏黃色</p>\r\n<p>若喜歡比較亮的冰友們，可能會覺得暗一點</p>\r\n<p>讓QQ鈞最驚訝的就是這個「壽星方案」</p>\r\n<p>可以看出飯店的用心</p>\r\n<p>&nbsp;</p>\r\n<p>贈送的紅酒更是意外的好喝</p>\r\n<p>因為呆呆維不喝酒，這瓶紅酒跟了我繞了台灣一圈呢😂😂</p>\r\n<p>💡房間：👍👍👍👍</p>\r\n<p>💡View：👍👍👍👍</p>\r\n<p>💡早餐：👍👍👍</p>\r\n<p>💡價格:&nbsp; 👍👍👍👍👍</p>\r\n<p>&nbsp;</p>\r\n<p>【花蓮翰品酒店 酒店資訊】</p>\r\n<p>🕋地址：花蓮縣花蓮市永興路2號</p>\r\n<p>☎電話：<a href=\"https://www.google.com/search?q=%E8%8A%B1%E8%93%AE%E7%BF%B0%E5%93%81%E9%85%92%E5%BA%97&amp;rlz=1C1GCEB_enTW809TW809&amp;biw=1280&amp;bih=577&amp;sxsrf=ALiCzsbY3GSH9d7jbez-zIEVrrfNm-8K5Q:1666163595265&amp;ei=9kxOY6SEGceF-Ab_wJbIAQ&amp;oq=%E8%8A%B1%E8%93%AE%E7%BF%B0%E5%93%81&amp;gs_&amp;sclient=gws-wiz&amp;tbs=lf:1,lf_ui:2&amp;tbm=lcl&amp;rflfq=1&amp;num=10&amp;rldimm=5127955564783343903&amp;lqi=ChLoirHok67nv7Dlk4HphZLlupdI75HC98-rgIAIWicQABABEAIQAxgAGAEYAhgDIhXoirHok64g57-wIOWTgSDphZLlupeSAQVob3RlbJoBI0NoWkRTVWhOTUc5blMwVkpRMEZuU1VNMloyUnVVVUZSRUFF&amp;ved=2ahUKEwid2e6J3-v6AhVTc3AKHcDlCwYQvS56BAhZEAE&amp;sa=X&amp;rlst=f\" target=\"_blank\" rel=\"noopener noreferrer\">03 823 5388</a></p>\r\n<p>💻飯店網站 :&nbsp;<a href=\"https://hualien.chateaudechine.com/tw/index\" target=\"_blank\" rel=\"noopener noreferrer\">https://hualien.chateaudechine.com/tw/index</a></p>\r\n<p>🎀喜歡QQ鈞的冰友，請按追縱喔🎀</p>\r\n<p>我會繼續吃吃喝喝幫大家發現好吃好玩的地方😊</p>', NULL, NULL, 9, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1668408962-1672179172-g_l.jpg\"]', '2023-01-16 05:56:00', '2023-01-16 05:59:41'),
(20, 25, '《扭蛋》史努比環保扭蛋', 3, 'PEANUTS－SNOOPY－（2019/03）（日本發售）', '<p>1. PEANUTS－SNOOPY－（2019/03）（日本發售）</p>\r\n<div><img src=\"https://pic.pimg.tw/emily8/1577645478-315820410_n.jpg\" alt=\"\" loading=\"lazy\"><br>\r\n<div>2. PEANUTS 2－BEST FRIENDS－（2019/09）（日本發售）</div>\r\n<div><img src=\"https://pic.pimg.tw/emily8/1577645563-3419908773_n.jpg\" alt=\"\" loading=\"lazy\"></div>\r\n<div>3. PEANUTS 3－BASEBALL－（2020/01）（日本發售）</div>\r\n</div>\r\n<div><img src=\"https://pic.pimg.tw/emily8/1579706207-2784758622.jpg\" alt=\"\" loading=\"lazy\"></div>\r\n<div>&nbsp;</div>\r\n<div>4. PEANUTS 4－ASTRONAUT SNOOPY －（2020/08）（日本發售）￥500</div>\r\n<div><img src=\"https://pic.pimg.tw/emily8/1597782073-4211808617-g_n.jpg\" alt=\"\" loading=\"lazy\"></div>\r\n<div>&nbsp;</div>\r\n<div>5. P5 (2022/09)</div>\r\n<div>&nbsp;</div>', NULL, NULL, 10, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1577645478-315820410_n-fit-500.jpg\"]', '2023-01-16 05:59:00', '2023-01-16 05:59:32'),
(21, 24, '彰化市區｜彰化阿璋肉圓｜那些年的國宴肉圓', 3, '吃了阿三又吃了北門口\r\n怎麼樣都要再來阿璋朝聖一下', '<h2>&nbsp;</h2>\r\n<h2>吃了阿三又吃了北門口</h2>\r\n<div class=\"article-body\">\r\n<div class=\"article-content\">\r\n<div id=\"article-content-inner\" class=\"article-content-inner\">\r\n<p>怎麼樣都要再來阿璋朝聖一下</p>\r\n<p>阿璋位置很好，火車站附近走路一下就到了</p>\r\n<p>跟店家點了肉圓之後</p>\r\n<p>就是端著自己找位置坐下來享用</p>\r\n<p>雖然這兩、三間的店面風格不一樣</p>\r\n<p>但都是同一間店，點餐區都在這個轉角</p>\r\n<p><img title=\"圖片\" src=\"https://pic.pimg.tw/aw78/1668775438-434133218-g_n.png\" alt=\"圖片\" width=\"350\" height=\"263\" loading=\"lazy\"></p>\r\n<p>更有味道一點的內用區</p>\r\n<p><img title=\"IMG_20221117_125709.jpg\" src=\"https://pic.pimg.tw/aw78/1668775018-1461616498-g_n.jpg\" alt=\"IMG_20221117_125709.jpg\" width=\"350\" height=\"263\" loading=\"lazy\"></p>\r\n<p>看起來特別氣派的內用區</p>\r\n<p>牆上還看得到郭台銘在民國七十多年就來吃的簽名</p>\r\n<p>還有馬英九、蔡英文當總統的時候都有來吃的簽名</p>\r\n<p><img title=\"IMG_20221117_125657.jpg\" src=\"https://pic.pimg.tw/aw78/1668775017-302577754-g_n.jpg\" alt=\"IMG_20221117_125657.jpg\" width=\"350\" height=\"263\" loading=\"lazy\"></p>\r\n<div class=\"article-inread-ad\" data-adindex=\"1\"><ins class=\"adsbyfalcon pixnet-ad\" data-ad-client=\"1\" data-ad-slot=\"3542\" data-merge-position=\"3342\" data-sibling-position=\"4386\" data-embed=\"false\" data-adsbyfalcon-status=\"done\">\r\n<div id=\"pixad3342d\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-6865528665029394\" data-ad-slot=\"3party_criteo_pb_pc_article_center01\" data-adsbygoogle-status=\"done\" data-ad-status=\"filled\">\r\n<div id=\"aswift_0_host\" tabindex=\"0\" title=\"Advertisement\" aria-label=\"Advertisement\"><iframe id=\"aswift_0\" src=\"https://googleads.g.doubleclick.net/pagead/ads?client=ca-pub-6865528665029394&amp;output=html&amp;h=280&amp;slotname=3party_criteo_pb_pc_article_center01&amp;adk=3070957094&amp;adf=584519714&amp;pi=t.ma~as.3party_criteo_pb_pc_&amp;w=336&amp;lmt=1673848804&amp;format=336x280&amp;url=https%3A%2F%2Faw78.pixnet.net%2Fblog%2Fpost%2F36278138-%25e5%25bd%25b0%25e5%258c%2596%25e5%25b8