mp;u_tz=480&amp;u_his=1&amp;u_h=864&amp;u_w=1536&amp;u_ah=824&amp;u_aw=1536&amp;u_cd=24&amp;u_sd=1.25&amp;dmc=8&amp;adx=557&amp;ady=1834&amp;biw=1519&amp;bih=666&amp;scr_x=0&amp;scr_y=0&amp;eid=44759875%2C44759926%2C44759842%2C44777876&amp;oid=2&amp;pvsid=3557716224079012&amp;tmod=32352014&amp;uas=3&amp;nvt=1&amp;ref=https%3A%2F%2Fwww.pixnet.net%2F&amp;eae=0&amp;fc=896&amp;brdim=0%2C0%2C0%2C0%2C1536%2C0%2C1536%2C824%2C1536%2C666&amp;vis=1&amp;rsz=%7C%7CoeEbr%7C&amp;abl=CS&amp;pfx=0&amp;fu=0&amp;bc=31&amp;ifi=8&amp;uci=a!8&amp;btvi=2&amp;fsb=1&amp;xpc=OGoWUevpaK&amp;p=https%3A//aw78.pixnet.net&amp;dtd=124\" name=\"aswift_4\" width=\"336\" height=\"280\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" data-google-container-id=\"a!8\" data-google-query-id=\"CMirz9q0y_wCFXJIDwId03gPbA\" data-load-complete=\"true\"></iframe></div>\r\n</ins></div>\r\n</ins></div>\r\n<p>&nbsp;</p>\r\n<p>外皮來看就跟阿三、北門口蠻不一樣的</p>\r\n<p>也比較是平常會在路邊吃到的肉圓</p>\r\n<p><img title=\"IMG_20221117_125014.jpg\" src=\"https://pic.pimg.tw/aw78/1668775018-1961653854-g_n.jpg\" alt=\"IMG_20221117_125014.jpg\" width=\"350\" height=\"263\" loading=\"lazy\"></p>\r\n<p>一把插起來就插到了肉塊</p>\r\n<p><img title=\"IMG_20221117_125011.jpg\" src=\"https://pic.pimg.tw/aw78/1668775016-1295562242-g_n.jpg\" alt=\"IMG_20221117_125011.jpg\" width=\"350\" height=\"263\" loading=\"lazy\"></p>\r\n<p>就真的是一個平常吃得到的好吃肉圓</p>\r\n<p>上了國宴的平民美食</p>\r\n<p>彰化人說是他從小吃到大的味道</p>\r\n<p>我個人是認為要吃點當地「特色」的話</p>\r\n<p>外皮是略輸阿三跟北門口炸成碰皮的特色啦</p>\r\n<p>&nbsp;</p>\r\n<p><img title=\"\" src=\"https://s.pixfs.net/f.pixnet.net/images/emotions/032.gif\" alt=\"\" width=\"20\" height=\"20\" loading=\"lazy\">彰化阿璋肉圓</p>\r\n<p>500彰化縣彰化市長安街144號</p>\r\n<p>營業時間　9:00-22:00</p>\r\n</div>\r\n</div>\r\n</div>', NULL, NULL, 11, 'online', 1, NULL, NULL, NULL, NULL, '[\"articles/1668775018-1961653854-g_n-fit-500.jpg\"]', '2023-01-16 06:01:00', '2023-01-16 06:02:06');
