(2, 3, 'index', 'image', '這是一首由禮物、情感和時光交織的樂曲。', 'introduction', NULL, NULL, '<ul>\r\n<li style=\"font-weight: bold; text-align: center;\"><strong>● 紀念，我們的回憶不變</strong></li>\r\n<li style=\"font-weight: bold; text-align: center;\"><strong>● 紀念，我們的獨特體驗</strong></li>\r\n<li style=\"font-weight: bold; text-align: center;\"><strong>● 紀念，我們的驚喜發現</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>', '#', '因為你的心意，禮物才有意義', '[\"elements/FotoJet-500-x.png\"]', NULL, NULL, NULL, '#000000', NULL, NULL, 2, 1, 1, '2023-01-14 13:05:05', '2023-05-30 07:31:55'),
(3, 3, 'index', 'image', '分享您的一些資訊，尋找到志同道合的夥伴', 'introduction', NULL, NULL, '<ul>\r\n<li>● 您可以分享一些資訊讓人主動了解你</li>\r\n<li>●當您是社團發起人，交友關係由你決定!</li>\r\n<li>●想更了解他人，發送了解更多，並設計你想了解的內容!</li>\r\n<li>●只要對方同意，你們也能先成為朋友^^</li>\r\n</ul>', '/about', '了解更多', '[\"elements/4-fit-500.jpg\"]', NULL, NULL, NULL, '#000000', NULL, NULL, 1, 1, 1, '2023-01-14 13:48:19', '2023-05-30 06:28:30');
