(1, 7, 'MERCI Design 黑化新款登場 摩艾造型20吋登機箱', '[\"items/賣家1/實體商品/01/800x0 (2).jpg\",\"items/賣家1/實體商品/01/800x0 (1).jpg\",\"items/賣家1/實體商品/01/800x0 (3).jpg\",\"items/賣家1/實體商品/01/800x0 (4).jpg\",\"items/賣家1/實體商品/01/800x0 (5).jpg\",\"items/賣家1/實體商品/01/800x0 (6).jpg\",\"items/賣家1/實體商品/01/800x0.jpg\"]', 3855, 3618, NULL, 5, 35, '<div class=\"m-product-list-item\">商品材質<a href=\"https://www.pinkoi.com/browse?cagetory=1&amp;subcategory=117&amp;material=32&amp;ref_sec=basic_info&amp;ref_created=1677550417&amp;ref_entity=item&amp;ref_entity_id=dDnnkdrS\">聚酯纖維</a></div>\r\n<div class=\"m-product-list-item\">製造方式機器製造</div>\r\n<div class=\"m-product-list-item\">商品產地中國大陸</div>\r\n<div class=\"m-product-list-item\">庫存10 件以上</div>\r\n<div class=\"m-product-list-item\">商品熱門度\r\n<ul>\r\n<li>被欣賞 49,278 次</li>\r\n<li>已賣出 102 件商品</li>\r\n<li>共 1506 人收藏</li>\r\n</ul>\r\n</div>\r\n<div class=\"m-product-list-item\">販售許可<span class=\"g-flex g-items-center\">原創商品</span></div>\r\n<div class=\"m-product-list-item\">商品摘要※※※※※※※※本商品限宅配出貨※※※※※※※※ 台灣設計及監製 外型仿造復活島Moai石像 表層為金屬絲拉紋質感 拉鍊頭設計為摩艾造型</div>', '<p>※※※※※※※※本商品限宅配出貨※※※※※※※※<br><br>極致黑早鳥預購中，預計3月底到貨，提早到貨提前出貨。<br>太空銀，現貨供應，下單即出貨。<br><br><span class=\"m-richtext-video-wrap\"><iframe class=\"m-richtext-el m-richtext-video\" src=\"https://www.youtube.com/embed/xP03dPUh7Ps\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span><br><br>※下單即贈摩艾行李箱吊牌乙個(不挑色)<br>顏色：極致黑|鋼鐵灰|太空銀<br>尺寸：22x37x56cm(符合國際IATA登機標準)<br>重量：2.57KG<br>容量：40.7L<br>材質：高性能100%純PC材質<br>表層：金屬絲拉紋<br>品牌：MERCI Design<br>設計：台灣<br>製造：上市櫃第一大廠監製<br>保固：1年保固，5年保修<br>國家安全標章驗證：R64848<br>*注意：照片皆為實拍，拍攝時受環境、光線及角度影響，且螢幕可能有些許色差，實際顏色會以實品為準，展示間也有實品，歡迎現場參觀，謝謝<br><br>內箱及配件：<br>內裝：彈性交叉束帶+雙面拉鍊網狀隔板+收納內袋<br>拉鍊：雙層防爆拉鍊設計，安全抗爆，防水性更佳<br>拉桿：三段式專利鋁合金拉桿<br>滾輪：高品質360度耐磨靜音飛機輪組，用世界領先滑輪材質的耐磨靜音輪，推拉省力又方便<br>密碼鎖：內崁式國際TSA海關密碼鎖</p>', NULL, NULL, 1, 1, '2023-02-28 02:12:57', '2023-02-28 05:58:11', 3),
(2, 12, 'Dumdum行李箱吊牌', '[\"items/賣家1/實體商品/02/800x0 (1).jpg\",\"items/賣家1/實體商品/02/800x0 (2).jpg\",\"items/賣家1/實體商品/02/800x0 (3).jpg\",\"items/賣家1/實體商品/02/800x0 (4).jpg\",\"items/賣家1/實體商品/02/800x0 (5).jpg\",\"items/賣家1/實體商品/02/800x0 (6).jpg\"]', 190, 190, NULL, 5, 18, '<div class=\"m-product-list-item\"><a href=\"https://www.pinkoi.com/browse?cagetory=2&amp;subcategory=242&amp;material=58&amp;ref_sec=basic_info&amp;ref_created=1677556174&amp;ref_entity=item&amp;ref_entity_id=6P4mp7xr\">環保材質</a></div>\r\n<div class=\"m-product-list-item\">製造方式機器製造</div>\r\n<div class=\"m-product-list-item\">商品產地中國大陸</div>\r\n<div class=\"m-product-list-item\">庫存10 件以上</div>\r\n<div class=\"m-product-list-item\">商品熱門度\r\n<ul>\r\n<li>被欣賞 7,153 次</li>\r\n<li>已賣出 96 件商品</li>\r\n<li>共 500 人收藏</li>\r\n</ul>\r\n</div>\r\n<div class=\"m-product-list-item\">販售許可<span class=\"g-flex g-items-center\">原創商品</span></div>\r\n<div class=\"m-product-list-item\">商品摘要仿造復活島Moai石像 超酷的造型行李箱吊牌 MERCI Design獨家開發設計 設計獨立完整的精美包裝</div>', '<p>顏色：深灰｜水泥灰<br>材質：環保橡膠<br>尺寸：長13x寬7cm<br>重量：100g<br>配件：固定帶<br>設計：MERCI Design</p>', NULL, NULL, 1, 1, '2023-02-28 03:58:20', '2023-02-28 05:35:36', 3),
(3, 12, 'New新品!!半剖摩艾面紙盒', '[\"items/賣家1/實體商品/03/800x0 (1).jpg\",\"items/賣家1/實體商品/03/800x0 (3).jpg\",\"items/賣家1/實體商品/03/800x0 (4).jpg\",\"items/賣家1/實體商品/03/800x0 (8).jpg\",\"items/賣家1/實體商品/03/800x0.jpg\"]', 1750, 1750, NULL, 5, 16, '<div class=\"m-product-list-item\">商品材質<a href=\"https://www.pinkoi.com/browse?cagetory=5&amp;subcategory=554&amp;material=52&amp;ref_sec=basic_info&amp;ref_created=1677557074&amp;ref_entity=item&amp;ref_entity_id=TeD3yArP\">樹脂</a></div>\r\n<div class=\"m-product-list-item\">製造方式手工製造</div>\r\n<div class=\"m-product-list-item\">商品產地台灣</div>\r\n<div class=\"m-product-list-item\">庫存剩最後 7 件</div>\r\n<div class=\"m-product-list-item\">商品熱門度\r\n<ul>\r\n<li>被欣賞 11,459 次</li>\r\n<li>已賣出 58 件商品</li>\r\n<li>共 370 人收藏</li>\r\n</ul>\r\n</div>\r\n<div class=\"m-product-list-item\">販售許可<span class=\"g-flex g-items-center\">原創商品</span></div>\r\n<div class=\"m-product-list-item\">商品摘要100%台灣手工製作 仿造復活島Moai石像 超酷的擺飾兼具面紙盒的功能 玻璃纖維防水材質，可放置戶外</div>', '<p>款示： 摩艾半剖金+深灰| 摩艾半剖灰+深灰<br>重量：淨重約1.8KG<br>尺寸：20cmX14cmX30cm<br>材質：使用樹脂＋玻璃纖維，堅韌耐用不褪色<br>功能：外觀仿造復活島Moai石像，凹凸表面增添質感及歲月風蝕的感覺，而半剖造型讓摩艾有骨有肉，成為全球第一款解剖摩艾，除了是超酷的擺飾外同時也兼具面紙盒的功能唷<br>包裝：紅點設計師專為摩艾面紙盒設計獨立完整的精美包裝<br>面紙：建議用100~120抽左右的面紙包，紙張不要太厚，大部份的品牌都有實測過，除了「舒潔牌」因為三層會比較不順暢外，其餘的沒有什麼問題，影片教學使用的是7-11特價品牌的新柔感。<br>檢驗：專利許可並符合SGS八大重金屬及塑化劑檢驗合格<br>製造地：台灣<br>鼻抽摩艾影片教學：<span class=\"m-richtext-video-wrap\"><iframe class=\"m-richtext-el m-richtext-video\" src=\"https://www.youtube.com/embed/Lhkmaw8Uih8\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></span><br><br>小叮嚀：<br>摩艾面紙盒：摩艾成份為玻纖+樹脂，新品出廠剛開始會有樹脂的特殊味道，建議用清水沖洗後，橫放一段時間，使內部空氣流通，味道會逐漸消失哦</p>', NULL, NULL, 1, 1, '2023-02-28 04:07:11', '2023-02-28 05:35:56', 3),
(4, 7, '【體驗】【6人包班另有優惠】地毯槍課程', '[\"items/賣家1/實體商品/04/800x0 (2).jpg\",\"items/賣家1/實體商品/04/800x0 (1).jpg\",\"items/賣家1/實體商品/04/800x0 (3).jpg\",\"items/賣家1/實體商品/04/800x0 (4).jpg\",\"items/賣家1/實體商品/04/800x0 (5).jpg\",\"items/賣家1/實體商品/04/800x0.jpg\"]', 3800, 3800, NULL, 5, 50, '<h2 class=\"m-box-title\">活動資訊</h2>\r\n<div class=\"m-box-body\">\r\n<div class=\"m-product-list-item\">活動摘要學習tufting gun ，自己動手做地毯，讓居家充滿你的個人風格吧！ 什麼是tufting gun 呢？ 他是藉由機械槍 , 重複穿刺在布料上，藉由布料表面張力留住纖維，能自由創作，打造獨一無二的禮物。</div>\r\n<div class=\"m-product-list-item\">最近活動日期2023/03/03 (五)</div>\r\n<div class=\"m-product-list-item\">預約須知活動日 1 天前需付款完成</div>\r\n<div class=\"m-product-list-item\">活動所在地台灣 / 台北市</div>\r\n<div class=\"m-product-list-item\">活動語言中文</div>\r\n<div class=\"m-product-list-item\">活動地址台北市大同區迪化街一段14巷38號2樓</div>\r\n<div class=\"m-product-list-item\">開放入場時間活動開始前 10 分鐘</div>\r\n<div class=\"m-product-list-item\">活動長度見活動內容</div>\r\n<div class=\"m-product-list-item\">最低年齡限制12 歲以上</div>\r\n<div class=\"m-product-list-item\">完成品材質羊毛</div>\r\n<div class=\"m-product-list-item\">剩餘名額154</div>\r\n<div class=\"m-product-list-item\">活動提供者珄笙纖維藝術工作室</div>\r\n<div class=\"m-product-list-item\">活動提供者將依法開立發票 / 收據 / 購買證明予消費者</div>\r\n<div class=\"m-product-list-item\">&nbsp;</div>\r\n<div class=\"m-product-list-item\">&nbsp;</div>\r\n</div>', '<div id=\"scroll-hooks-detail\" data-sticky-target=\"detail\" data-tracking-seen=\"detail\">\r\n<div id=\"js-block-detail\" class=\"m-box m-box-main m-product-detail\">\r\n<div class=\"m-box-body\">\r\n<div class=\"js-lazy-init richtext-content s-inited\">\r\n<div id=\"description\" class=\"m-product-detail-content js-detail-content s-clipe\" data-more=\"閱讀更多\" data-close=\"收合\">\r\n<div class=\"m-richtext js-detail-content-inner\">\r\n<div data-translate=\"description\">▌上課內容▌<br>1.tufting gun與punch needle（俄羅斯刺繡）工藝講解與介紹<br>2.布料繪圖的技巧（手繪在布料上，老師也會在一旁協助）<br>3.電槍的操作與練習<br>4.作品創作<br>5.作品修整與收尾<br>▌ 設計圖注意事項▌<br>1.建議使用2-3個顏色<br>2.線條粗細不能少於4mm<br>3.用色塊呈現，作品會更出色喔！<br>4.繳費後請提供設計圖給老師 (老師會頻估作品是否能執行）</div>\r\n<div data-translate=\"description\">▌上課地點 ▌<br>台北市大同區迪化街一段14巷38號2樓</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, NULL, 1, 1, '2023-02-28 04:19:20', '2023-02-28 05:36:19', 3),
(5, 7, '【體驗】小雛菊鉤針花 /初學者可/台北迪化街', '[\"items/賣家1/實體商品/05/800x0 (6).jpg\",\"items/賣家1/實體商品/05/800x0 (1).jpg\",\"items/賣家1/實體商品/05/800x0 (2).jpg\",\"items/賣家1/實體商品/05/800x0 (3).jpg\",\"items/賣家1/實體商品/05/800x0.jpg\"]', 1280, 1280, NULL, 5, 7, '<h2 class=\"m-box-title\">活動資訊</h2>\r\n<div class=\"m-box-body\">\r\n<div class=\"m-product-list-item\">活動摘要動手做出專屬自己的小花，不論是送禮或是自己收藏，都充滿美好的回憶</div>\r\n<div class=\"m-product-list-item\">最近活動日期2023/03/03 (五)</div>\r\n<div class=\"m-product-list-item\">預約須知活動日 2 天前需付款完成</div>\r\n<div class=\"m-product-list-item\">活動所在地台灣 / 台北市</div>\r\n<div class=\"m-product-list-item\">活動語言中文</div>\r\n<div class=\"m-product-list-item\">活動地址新北市大同區迪化街一段14巷38號2樓</div>\r\n<div class=\"m-product-list-item\">開放入場時間活動開始前 10 分鐘</div>\r\n<div class=\"m-product-list-item\">活動長度1.5 小時</div>\r\n<div class=\"m-product-list-item\">最低年齡限制6 歲以上</div>\r\n<div class=\"m-product-list-item\">完成品材質羊毛</div>\r\n<div class=\"m-product-list-item\">剩餘名額129</div>\r\n<div class=\"m-product-list-item\">活動提供者珄笙工作室</div>\r\n<div class=\"m-product-list-item\">&nbsp;活動提供者將依法開立發票 / 收據 / 購買證明予消費者</div>\r\n</div>', '<p>▌教學內容 ▌<br>＊ 鉤針使用<br>＊ 學習織圖<br>＊ 學習針法<br>＊ 作品縫合<br>▌小雛菊鉤針花 ▌<br>課程中學習一隻的製作方式，材料含有三隻的份量，可以自行回家繼續製作。</p>\r\n<p>▌綜合花束（花種四種加送鈴蘭花課程，5堂課優惠） ▌<br>花種四種：胖胖鬱金香，小雛菊，玫瑰，向日葵</p>\r\n<p>教室環境<br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/50955658447_56c442b68b_z.jpg\" data-src=\"https://live.staticflickr.com/65535/50955658447_56c442b68b_z.jpg\"><br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/50955657117_64490a9f26_z.jpg\" data-src=\"https://live.staticflickr.com/65535/50955657117_64490a9f26_z.jpg\"><br>▌課程資訊 ▌<br>課程時長｜1.5小時<br>課程費用｜含材料費．教學費及簡單茶水乙杯<br>成品數量及尺寸｜成品1個，材料能做三朵<br>開班人數 ｜6人滿班 1人即可開班<br>材料｜一人份：毛線．7號鉤針(租借），講義，其他配件<br>適合對象｜12歲以上<br><br>特別說明｜<br>*不可攜伴<br>*每個人速度不同，上課會講解所有的作法，若課程時間內無法完成，請同學回家繼續完成<br>*包班服務：滿開課人數，可自選上課時段</p>', NULL, NULL, 1, 1, '2023-02-28 04:42:43', '2023-02-28 05:36:44', 3),
(6, 7, '【體驗】簇絨面紙盒+生活小物組', '[\"items/賣家1/實體商品/06/800x0 (1).jpg\",\"items/賣家1/實體商品/06/800x0 (2).jpg\",\"items/賣家1/實體商品/06/800x0 (4).jpg\",\"items/賣家1/實體商品/06/800x0.jpg\"]', 2900, 2900, NULL, 5, 4, '<h2 class=\"m-box-title\">活動資訊</h2>\r\n<div class=\"m-box-body\">\r\n<div class=\"m-product-list-item\">活動摘要A+Do Studio 帶領你進入療癒的 Tufting 世界，發揮創意，打造屬於自己獨一無二的 TUFT 作品✨</div>\r\n<div class=\"m-product-list-item\">最近活動日期2023/03/01 (三)</div>\r\n<div class=\"m-product-list-item\">預約須知活動日 1 天前需付款完成</div>\r\n<div class=\"m-product-list-item\">活動所在地台灣 / 台北市</div>\r\n<div class=\"m-product-list-item\">活動語言中文</div>\r\n<div class=\"m-product-list-item\">活動地址台北市民生西路 178 巷 1 號 4</div>\r\n<div class=\"m-product-list-item\">開放入場時間活動開始前 10 分鐘</div>\r\n<div class=\"m-product-list-item\">活動長度見活動內容</div>\r\n<div class=\"m-product-list-item\">最低年齡限制見活動內容</div>\r\n<div class=\"m-product-list-item\">剩餘名額160</div>\r\n<div class=\"m-product-list-item\">活動提供者A+Do Studio</div>\r\n<div class=\"m-product-list-item\">&nbsp;活動提供者將依法開立發票 / 收據 / 購買證明予消費者</div>\r\n</div>', '<div id=\"scroll-hooks-detail\" data-sticky-target=\"detail\" data-tracking-seen=\"detail\">\r\n<div id=\"js-block-detail\" class=\"m-box m-box-main m-product-detail\">\r\n<div class=\"m-box-body\">\r\n<div class=\"js-lazy-init richtext-content s-inited\">\r\n<div id=\"description\" class=\"m-product-detail-content js-detail-content s-clipe\" data-more=\"閱讀更多\" data-close=\"收合\">\r\n<div class=\"m-richtext js-detail-content-inner\">\r\n<div data-translate=\"description\">一把地毯槍，就可以打造出屬於自己獨一無二的 TUFT 作品<br>你不需要非常厲害的繪圖技巧，跟著我們大膽發揮你的創意<br>利用簡單的色塊、線條，享受這段療癒的時光，輕鬆打造出屬於自己風格的作品<br><strong class=\"m-richtext-el\">【課程內容】</strong><br>將你喜歡的圖案用毛線&rdquo;打&rdquo;在畫布裡，可以是一張地毯，一個壁掛裝飾，可以是一面鏡子，甚至是一幅畫，讓我們帶領你進入這療癒的 Tufting 世界，製作出屬於自己獨一無二的作品。<br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/52086530410_00b7695303_b.jpg\" data-src=\"https://live.staticflickr.com/65535/52086530410_00b7695303_b.jpg\"><br><br><br><br><strong class=\"m-richtext-el\">【尺寸/費用】</strong><br>課程可做一個面紙盒套跟其它生活小物<br>小物可做杯墊.鑰匙圈.吊飾.容器套.手機氣墊架⋯⋯等<br>&bull;面紙盒套 24<em class=\"m-richtext-el\">14</em>11cm<br>*生活小物 ：高10公分<br>*下方注意事項有詳細說明，下單 / 發問先請先詳讀<br>謝謝<br><br><strong class=\"m-richtext-el\">【關於 A+Do Studio】</strong><br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/52086530435_17fc2d91b6_b.jpg\" data-src=\"https://live.staticflickr.com/65535/52086530435_17fc2d91b6_b.jpg\"></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"scroll-hooks-notice-exp\" data-sticky-target=\"notice-exp\" data-tracking-seen=\"notice-exp\">\r\n<div id=\"js-block-notice-exp\" class=\"m-box m-box-main m-product-notice-exp\">\r\n<div class=\"m-box-body\">\r\n<div class=\"js-lazy-init richtext-content s-inited\">\r\n<div id=\"notice-exp\" class=\"m-product-detail-content js-detail-content\" data-more=\"閱讀更多\" data-close=\"收合\">\r\n<div class=\"m-richtext js-detail-content-inner\">\r\n<div data-translate=\"notice\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, NULL, 1, 1, '2023-02-28 04:50:54', '2023-02-28 05:39:25', 3),
(7, 7, '【體驗】【雙人 88 折】新北金工教室・情侶手作體驗課程・純銀項鍊墜', '[\"items/賣家1/實體商品/07/800x0.jpg\",\"items/賣家1/實體商品/07/800x0 (1).jpg\",\"items/賣家1/實體商品/07/800x0 (4).jpg\",\"items/賣家1/實體商品/07/800x0 (3).jpg\",\"items/賣家1/實體商品/07/800x0 (2).jpg\",\"items/賣家1/實體商品/07/800x0 (5).jpg\",\"items/賣家1/實體商品/07/800x0 (6).jpg\"]', 2280, 2280, NULL, 5, 10, '<div class=\"m-product-list-item\">活動摘要動手做飾品 注入手感的溫度 留下寶貴的回憶 每一個成品都獨一無二 適合自己配戴或送禮 體驗可以是一個人的療癒時光 也能是情侶的增溫行程 更可以做為三五好友聊天聚會節目 🥰</div>\r\n<div class=\"m-product-list-item\">最近活動日期2023/03/03 (五)</div>\r\n<div class=\"m-product-list-item\">預約須知活動日 3 天前需付款完成</div>\r\n<div class=\"m-product-list-item\">活動所在地台灣 / 新北市</div>\r\n<div class=\"m-product-list-item\">活動語言中文, 英文</div>\r\n<div class=\"m-product-list-item\">活動地址新北市林口區四維路52-1號2樓</div>\r\n<div class=\"m-product-list-item\">開放入場時間活動開始前 15 分鐘</div>\r\n<div class=\"m-product-list-item\">活動長度3 小時</div>\r\n<div class=\"m-product-list-item\">最低年齡限制見活動內容</div>\r\n<div class=\"m-product-list-item\">完成品材質純銀</div>\r\n<div class=\"m-product-list-item\">剩餘名額612</div>\r\n<div class=\"m-product-list-item\">活動提供者茉合桂物室內裝修設計工程有限公司</div>\r\n<div class=\"m-product-list-item\">&nbsp;活動提供者將依法開立發票 / 收據 / 購買證明予消費者</div>', '<div id=\"scroll-hooks-detail\" data-sticky-target=\"detail\" data-tracking-seen=\"detail\">\r\n<div id=\"js-block-detail\" class=\"m-box m-box-main m-product-detail\">\r\n<div class=\"m-box-body\">\r\n<div class=\"js-lazy-init richtext-content s-inited\">\r\n<div>\r\n<div id=\"description\" class=\"m-product-detail-content js-detail-content s-clipe\" data-more=\"閱讀更多\" data-close=\"收合\">\r\n<div class=\"m-richtext js-detail-content-inner\">\r\n<div data-translate=\"description\">年滿 7 歲都可以參加茉合金工體驗<br>講師將手把手教學，讓沒有經驗的你也能做出獨一無二的飾品<br>送禮也能讓對方感受其中溫度 💌<br><br>現場有多款圖案可供選擇，也歡迎現場討論客製款<br>某些款式還能敲上喜歡的數字/英文字<br>紀錄生日、紀念日、座標、名字、詞句等替飾品加分 👍<br><br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/52611657677_430ce02e94.jpg\" data-src=\"https://live.staticflickr.com/65535/52611657677_430ce02e94.jpg\"><br><br>｜體驗說明｜<br><br>・課程時間：約 3 小時<br>・體驗內容：敲印刻字、扭轉塑型、金工切鋸、焊接等<br>・成品材質：925 / 999 純銀 / 黃銅 / 皮革<br>・費用包含：場地、工作服、練習材料、工具、成品一件<br>・附品牌紙袋、質感包裝、拭銀布、保固卡（享一年免費清潔保養）、休憩空間及一樓咖啡廳飲品一杯（咖啡、茶、歐蕾）<br><br>｜體驗價位｜<br><br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/52612622680_176a8b5f8a.jpg\" data-src=\"https://live.staticflickr.com/65535/52612622680_176a8b5f8a.jpg\"><br>．項鍊墜 $2280<br>．附贈 16\"/18\" 銀鍊搭配<br><br>＊可以「逛逛設計館」有其他款式可以參考喔！<br>＊上課當天選定款式、量尺寸，如款式超過預付金額，再補差額即可。<br>＊如做禮物送人，不知道對方實際尺寸，可抓大約尺寸，開放課堂後一次免費修改。<br><br>｜關於 茉合金工 MOKOPORO STUDIO｜<br><br>茉合金工於 2022 年正式成立，集結著一群對金工有所熱愛的創作者，希望透過教學金工建立起與人的連結<br>不管是做創作、教學課程、亦或是看著學員們拿著誠品心滿意足地拍照、都能激發我們的靈感，甚至感受到作品的情緒<br>這是我們的工作，也是每天的生活，用能讓自己感動的事讓每天都變成一個美好的創作品<br><br><img class=\"m-richtext-el m-richtext-img lazyloaded\" src=\"https://live.staticflickr.com/65535/52611696957_40bb03353d.jpg\" data-src=\"https://live.staticflickr.com/65535/52611696957_40bb03353d.jpg\"><br><br>茉合金工空間以茂盛大樹的枝葉作為設計理念，環境充滿著不同的植物，讓每次創作都彷彿置身於森林中<br><br>Provide you a relaxing atmosphere to unlock your creative flow ✨</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"scroll-hooks-notice-exp\" data-sticky-target=\"notice-exp\" data-tracking-seen=\"notice-exp\">\r\n<div id=\"js-block-notice-exp\" class=\"m-box m-box-main m-product-notice-exp\">\r\n<h2 class=\"m-box-title\">注意事項</h2>\r\n<div class=\"m-box-body\">\r\n<div class=\"js-lazy-init richtext-content s-inited\">\r\n<div id=\"notice-exp\" class=\"m-product-detail-content js-detail-content\" data-more=\"閱讀更多\" data-close=\"收合\">\r\n<div class=\"m-richtext js-detail-content-inner\">\r\n<div data-translate=\"notice\">・預約時段｜平日假日 12:00 \\ 16:00<br>・體驗時間｜約 3 小時，依體驗款式及現場狀況而異<br>・活動對象｜7 歲以上對金工手作有興趣的朋友<br>（製作過程會使用到火槍，小朋友都將有講師陪同，請家長自行斟酌）<br>・上課期間應遵守工具使用規則及配合講師指示，若因違反而導致工具損害，需造價賠償<br>・請提早10-15分鐘抵達，以確保課程能準時開始。體驗當天若遲到超過30分鐘或無出席，皆視同無故缺席，恕不退款亦無法延期<br>・體驗活動中因個人因素而臨時退出課程，恕不退訂金款亦無法延期<br>・最晚請於課程開始日三天前預約，滿2人即開課，如不足三天，將視現場狀況開課<br>・如因天災等不可抗力因素停課，PINKOI將主動聯繫延期或退款，若遇颱風停課，以課程舉辦地所公告的停課標準為開課及退費標準<br>・如需改期，每筆訂單供改期一次 ; 若因個人因素無法出席，可透過訂單申請退款，將酌收30%課程費用，由於講師須於課程前三天準備材料，若於課程開始日前三天內取消恕不受理退款或改期<br>・過程中若因個人疏失，造成材料製作錯誤或損壞，需要重新購買材料，才能繼續製作。</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', NULL, NULL, 1, 1, '2023-02-28 05:05:20', '2023-02-28 05:37:13', 3);
